: true,     \r\n        \"oTableTools\":{\r\n            \"sRowSelect\": \"single\"\r\n        },\r\n        \"iDisplayLength\": options.pageSize || 15,\r\n\r\n        \"aoColumns\": options.columns,\r\n      \r\n        \"sAjaxDataProp\": \"data\",\r\n        \"oLanguage\": {\r\n            //\"sLengthMenu\": \"Her sayfada  _MENU_ kayıt görülsün\",\r\n            //\"sZeroRecords\": \"Kayıt bulunamadı\",\r\n            //\"sInfo\": \" Görüntülenen: _START_ - _END_ |  Toplam: _TOTAL_  kayıt\",\r\n            //\"sInfoEmpty\": \"Görüntülenecek kayıt yok.\",\r\n            //\"sInfoFiltered\": \"  Toplam kayıt sayısı: _MAX_ \",\r\n            //\"sSearch\": \"Ara\"\r\n        }\r\n    });\r\n\r\n    $(\'table th input:checkbox\').on(\'click\', function () {\r\n        var that = this;\r\n        $(this).closest(\'table\').find(\'tr td input:checkbox\')\r\n        .each(function () {\r\n            this.checked = that.checked;\r\n            $(this).closest(\'tr\').toggleClass(\'checked\');\r\n        });\r\n    });\r\n\r\n    $(\'table td input:checkbox\').on(\'click\', function () {\r\n        $(this).closest(\'tr\').toggleClass(\'checked\');\r\n    });\r\n\r\n    $(\"#table-entity tbody tr\").on(\'dblclick\',function (e) {\r\n        if ($(this).hasClass(\'row_selected\')) {\r\n            $(this).removeClass(\'row_selected\');\r\n        }\r\n        else {\r\n            oTable1.$(\'tr.row_selected\').removeClass(\'row_selected\');\r\n            $(this).addClass(\'row_selected\');\r\n        }\r\n    });\r\n\r\n    $(\'[data-rel=\"tooltip\"]\').tooltip({ placement: tooltip_placement });\r\n    function tooltip_placement(context, source) {\r\n        var $source = $(source);\r\n        var $parent = $source.closest(\'table\')\r\n        var off1 = $parent.offset();\r\n        var w1 = $parent.width();\r\n\r\n        var off2 = $source.offset();\r\n        var w2 = $source.width();\r\n\r\n        if (parseInt(off2.left) < parseInt(off1.left) + parseInt(w1 / 2)) return \'right\';\r\n        return \'left\';\r\n    }\r\n    \r\n    $(options.tableId).prev().find(\'.col-sm-6\').hide();\r\n}\r\n\r\n$(function(){\r\n    $(\'input[type=file]\').ace_file_input({\r\n		no_file:\'No File ...\',\r\n		btn_choose:\'Choose\',\r\n		btn_change:\'Change\',\r\n		droppable:false,\r\n		onchange:null,\r\n		thumbnail: true, //| large\r\n		whitelist:\'gif|png|jpg|jpeg\'\r\n		//blacklist:\'exe|php\'\r\n		//onchange:\'\'\r\n		//\r\n	});\r\n    \r\n    showNotifications();\r\n    showTasks();\r\n    \r\n	$(\".chosen-select\").chosen(); \r\n    \r\n	$(\'.date-picker\').datepicker({autoclose:true}).next().on(ace.click_event, function(){\r\n		$(this).prev().focus();\r\n	});\r\n	$(\'.date-range-picker\').daterangepicker().prev().on(ace.click_event, function(){\r\n		$(this).next().focus();\r\n	});\r\n    $(\'.input-mask-phone\').mask(\'+99 (999) 999-9999\');\r\n    $(\'.time-picker\').timepicker({\r\n		minuteStep: 10,\r\n		showSeconds: false,\r\n		showMeridian: false\r\n	}).next().on(ace.click_event, function(){\r\n		$(this).prev().focus();\r\n	});\r\n    \r\n    $(\'select[localize=1] option\').each(function(){\r\n        $(this).html(defHR($(this).attr(\'value\')));\r\n    });\r\n    $(\'label[localize=1]\').each(function(){\r\n        $(this).html(defHR($(this).html()));\r\n    });\r\n    \r\n	$(\'.bkspinner\').ace_spinner({value:0,min:0,max:999,step:1, btn_up_class:\'btn-info\' , btn_down_class:\'btn-info\'})\r\n	.on(\'change\', function(){\r\n		//alert(this.value)\r\n	});\r\n\r\n	$(\'.easy-pie-chart.percentage\').each(function(){\r\n		var $box = $(this).closest(\'.infobox\');\r\n		var barColor = $(this).data(\'color\') || (!$box.hasClass(\'infobox-dark\') ? $box.css(\'color\') : \'rgba(255,255,255,0.95)\');\r\n		var trackColor = barColor == \'rgba(255,255,255,0.95)\' ? \'rgba(255,255,255,0.25)\' : \'#E2E2E2\';\r\n		var size = parseInt($(this).data(\'size\')) || 50;\r\n		$(this).easyPieChart({\r\n			barColor: barColor,\r\n			trackColor: trackColor,\r\n			scaleColor: false,\r\n			lineCap: \'butt\',\r\n			lineWidth: parseInt(size/10),\r\n			animate: /msie\\s*(8|7|6)/.test(navigator.userAgent.toLowerCase()) ? false : 1000,\r\n			size: size\r\n		});\r\n	})\r\n\r\n	$(\'.sparkline\').each(function(){\r\n		var $box = $(this).closest(\'.infobox\');\r\n		var barColor = !$box.hasClass(\'infobox-dark\') ? $box.css(\'color\') : \'#FFF\';\r\n		$(this).sparkline(\'html\', {tagValuesAttribute:\'data-values\', type: \'bar\', barColor: barColor , chartRangeMin:$(this).data(\'min\') || 0} );\r\n	});\r\n\r\n\r\n\r\n    //drawLineChartBulent();\r\n\r\n\r\n\r\n	$(\'#recent-box [data-rel=\"tooltip\"]\').tooltip({placement: tooltip_placement});\r\n	function tooltip_placement(context, source) {\r\n		var $source = $(source);\r\n		var $parent = $source.closest(\'.tab-content\')\r\n		var off1 = $parent.offset();\r\n		var w1 = $parent.width();\r\n\r\n		var off2 = $source.offset();\r\n		var w2 = $source.width();\r\n\r\n		if( parseInt(off2.left) < parseInt(off1.left) + parseInt(w1 / 2) ) return \'right\';\r\n		return \'left\';\r\n	}\r\n\r\n\r\n	$(\'.dialogs\').slimScroll({\r\n		height: \'300px\'\r\n    });\r\n	\r\n	\r\n	//Android\'s default browser somehow is confused when tapping on label which will lead to dragging the task\r\n	//so disable dragging when clicking on label\r\n	var agent = navigator.userAgent.toLowerCase();\r\n	if(\"ontouchstart\" in document && /applewebkit/.test(agent) && /android/.test(agent))\r\n	  $(\'#tasks\').on(\'touchstart\', function(e){\r\n		var li = $(e.target).closest(\'#tasks li\');\r\n		if(li.length == 0)return;\r\n		var label = li.find(\'label.inline\').get(0);\r\n		if(label == e.target || $.contains(label, e.target)) e.stopImmediatePropagation() ;\r\n	});\r\n\r\n	$(\'#tasks\').sortable({\r\n		opacity:0.8,\r\n		revert:true,\r\n		forceHelperSize:true,\r\n		placeholder: \'draggable-placeholder\',\r\n		forcePlaceholderSize:true,\r\n		tolerance:\'pointer\',\r\n		stop: function( event, ui ) {//just for Chrome!!!! so that dropdowns on items don\'t appear below other items after being moved\r\n			$(ui.item).css(\'z-index\', \'auto\');\r\n		}\r\n		});\r\n	$(\'#tasks\').disableSelection();\r\n	$(\'#tasks input:checkbox\').removeAttr(\'checked\').on(\'click\', function(){\r\n		if(this.checked) $(this).closest(\'li\').addClass(\'selected\');\r\n		else $(this).closest(\'li\').removeClass(\'selected\');\r\n	});\r\n    \r\n    var selectWithPlaceHolderChange = function(){\r\n        if($(this)[0].selectedIndex==0)\r\n            $(this).removeClass(\'selected\');\r\n        else\r\n            $(this).addClass(\'selected\');        \r\n    };\r\n    $(\'select.withPlaceHolder\').each(selectWithPlaceHolderChange);\r\n    $(\'select.withPlaceHolder\').change(selectWithPlaceHolderChange);\r\n				\r\n});\r\n\r\nfunction loadForm(theForm, entity, mode){\r\n    theForm = $(theForm);\r\n    theForm.data(\'entity\',entity);\r\n    if(mode && mode==\'view\'){\r\n        theForm.find(\':input\').attr(\"disabled\", true);\r\n        $(\'.ace-file-input\').hide();\r\n        theForm.find(\'.form-actions\').hide();\r\n        //theForm.find(\'.form-actions input[type=submit]\').replaceWith(\'<button class=\"btn btn-info\" type=\"button\" onclick=\"location.href = location.href.replace(\\\'mode=view\\\',\\\'mode=edit\\\')\"><i class=\"icon-ok bigger-110\"></i>Edit</button>\');\r\n    }\r\n    for(var key in entity){\r\n        try{\r\n            var ctrl = $(\'input[name=\'+key+\'],select[name=\'+key+\'],textarea[name=\'+key+\'],img[name=\'+key+\']\');\r\n            if(ctrl.length>0){\r\n                if(ctrl[0].tagName.toLowerCase()==\'select\' && ctrl.attr(\"multiple\"))\r\n                    setChosenValue(ctrl, entity[key]);\r\n                else if(ctrl[0].tagName.toLowerCase()==\'img\' && entity[key])\r\n                    ctrl.attr(\'src\', entity[key]);\r\n                else if(ctrl.attr(\'type\')==\'checkbox\')\r\n                    ctrl.prop(\'checked\', entity[key] ? true : false);\r\n                else if(ctrl.hasClass(\'date-picker\')){\r\n                    var d = entity[key].substr(0,10);\r\n                    if(d){\r\n                        var parts = d.split(\'-\');\r\n                        ctrl.val(parts[2]+\'-\'+parts[1]+\'-\'+parts[0]);\r\n                    }\r\n                }\r\n                else\r\n                    ctrl.val(entity[key]);\r\n            }\r\n        }catch(e){\r\n            console.log(e);\r\n        }\r\n    }\r\n}\r\n\r\nfunction setChosenValue(chosen, val){\r\n    $(chosen).val(val.split(\',\'));\r\n    $(chosen).trigger(\"chosen:updated\");\r\n}\r\n\r\nfunction makeChosen(select, entityName, filter){\r\n    var select = $(select);\r\n    select.chosen();\r\n	select.next().find(\".chosen-select-deselect\").chosen({allow_single_deselect:true});\r\n	select.next().find(\'.chosen-search input\').autocomplete({\r\n		source: function( request, response ) {\r\n            readEntityList(entityName, filter, function(entityList){\r\n                select.next().find(\'ul.chosen-results\').empty(); select.empty();\r\n				response( $.map( entityList, function( item ) {\r\n					select.next().find(\'ul.chosen-results\').append(\'<li class=\"active-result\">\' + item.Name + \'</li>\');\r\n					select.append(\'<option value=\"\' + item.Id + \'\">\' + item.Name + \'</option>\');\r\n				}));\r\n				select.trigger(\"chosen:updated\");\r\n            });\r\n		}\r\n	});\r\n}\r\n\r\nfunction fillSelectOptions(select, entityName, filter){\r\n    var select = $(select);\r\n    var entity = select.closest(\'form\').data(\'entity\');\r\n    readEntityList(entityName, filter, function(entityList){\r\n        var html = \'\';\r\n        entityList.each(function(item){\r\n    		html += \'<option value=\"\' + item.Id + \'\">\' + item.Name + \'</option>\';\r\n        });\r\n    	select.append(html);\r\n        if(entity){\r\n            var key = select.attr(\'id\'); \r\n            select.val(entity[key]);\r\n        }\r\n    }, \'Name\');\r\n}\r\n\r\nfunction defHR(name){\r\n    if(name==\"CompanyTag\")\r\n        return \"Tag\";\r\n    if(name==\"TaskType\")\r\n        return \"Task Type\";\r\n    if(name==\"ContactKind1\")\r\n        return \"Category 1\";\r\n    if(name==\"ContactKind2\")\r\n        return \"Category 2\";\r\n    if(name==\"ContactKind3\")\r\n        return \"Category 3\";\r\n    return name;\r\n}\r\nfunction wr(str){\r\n    document.write(str);\r\n}\r\n\r\n\r\nfunction updateEventContact(elm,id,eventId,contactId,state){\r\n    var itemDiv = $(elm).closest(\'.itemdiv\');\r\n    var lbl = itemDiv.find(\'.label-state\');\r\n    var oldState = lbl.text();\r\n    saveEntity(\'EventContact\', {\r\n        Id:id||0,\r\n        EventId:eventId,\r\n        ContactId:contactId,\r\n        State:state\r\n    }, function(){\r\n        lbl.html(state);\r\n        switch(state){\r\n            case \'Invited\':\r\n                lbl.attr(\'style\', \'background-color: orange !important\');\r\n                break;\r\n            case \'Joining\':\r\n                lbl.attr(\'style\', \'background-color: green !important\');\r\n                break;\r\n            case \'Rejected\':\r\n                lbl.attr(\'style\', \'background-color: red !important\');\r\n                break;\r\n        }\r\n        itemDiv.effect(\"shake\").effect(\"fold\", {complete:function(){\r\n            itemDiv.appendTo(\'#\'+state+\' .clearfix\');\r\n            itemDiv.show();\r\n            $(\'#\'+state+\'Count\').text(parseInt($(\'#\'+state+\'Count\').text())+1);\r\n            $(\'#\'+oldState+\'Count\').text(parseInt($(\'#\'+oldState+\'Count\').text())-1);\r\n        }});\r\n    });\r\n}\r\n\r\nfunction inviteContacts(toEventId){\r\n    var contactIds = $(\'input[name=selected_row]:checked\').map(function() {return this.value;});\r\n    \r\n}\r\nfunction checkContact(inp){\r\n    var name = $(inp).val();\r\n    $(inp).next(\'.checkContact\').html(\'\');\r\n    if(!name) return;\r\n    readEntityList(\'Contact\', \'Name=\'+name, function(list){\r\n        if(list && list.length>0)\r\n            $(inp).next(\'.checkContact\').html(\'<i class=\"icon-user red\"></i> See <a href=\"/CrmContactView.aspx?eId=\'+list[0].Id+\'\">\'+list[0].Name+\'</a>\');\r\n    });\r\n}\r\nfunction checkContactEmail(inp){\r\n    var name = $(inp).val();\r\n    $(inp).next(\'.checkContact\').html(\'\');\r\n    if(!name) return;\r\n    readEntityList(\'Contact\', \'Email=\'+name, function(list){\r\n        if(list && list.length>0)\r\n            $(inp).next(\'.checkContact\').html(\'<i class=\"icon-user red\"></i> See <a href=\"/CrmContactView.aspx?eId=\'+list[0].Id+\'\">\'+list[0].Name+\'</a>\');\r\n    });\r\n}\r\n\r\nfunction drawLineChartBulent(){\r\n    var d1 = [];\r\n	for (var i = 0; i < Math.PI * 2; i += 0.5) {\r\n		d1.push([i, Math.sin(i)]);\r\n	}\r\n\r\n	var d2 = [];\r\n	for (var i = 0; i < Math.PI * 2; i += 0.5) {\r\n		d2.push([i, Math.cos(i)]);\r\n	}\r\n\r\n	var d3 = [];\r\n	for (var i = 0; i < Math.PI * 2; i += 0.2) {\r\n		d3.push([i, Math.tan(i)]);\r\n	}\r\n	\r\n\r\n	var sales_charts = $(\'#sales-charts\').css({\'width\':\'100%\' , \'height\':\'220px\'});\r\n	$.plot(\"#sales-charts\", [\r\n		{ label: \"Domains\", data: d1 },\r\n		{ label: \"Hosting\", data: d2 },\r\n		{ label: \"Services\", data: d3 }\r\n	], {\r\n		hoverable: true,\r\n		shadowSize: 0,\r\n		series: {\r\n			lines: { show: true },\r\n			points: { show: true }\r\n		},\r\n		xaxis: {\r\n			tickLength: 0\r\n		},\r\n		yaxis: {\r\n			ticks: 10,\r\n			min: -2,\r\n			max: 2,\r\n			tickDecimals: 3\r\n		},\r\n		grid: {\r\n			backgroundColor: { colors: [ \"#fff\", \"#fff\" ] },\r\n			borderWidth: 1,\r\n			borderColor:\'#555\'\r\n		}\r\n	});    \r\n}\r\n\r\nvar ready = false;\r\n$(document).ready(function () {\r\n    if (ready) return;\r\n    ready = true;\r\n    $(\'.cinarChooser\').each(function () {\r\n        var ths = this;\r\n        $(ths).val($(ths).attr(\'prompt\'));\r\n        $(ths).wrap(\'<span class=\"cinarChooserWrapper\"></span>\');\r\n        $(ths).parent().append(\'<button type=\"button\" class=\"cinarChoserOkBtn btn btn-xs btn-info\" style=\"display:none\"><i class=\"icon-approve\"></i> OK</button>\');\r\n        $(ths).parent().find(\'.cinarChoserOkBtn\').click(function () {\r\n            var funcName = $(ths).attr(\"selectedCallback\");\r\n            var code = funcName + \"(\" + $(ths).attr(\'data-id\') + \", \'\" + $(ths).val() + \"\')\";\r\n            eval(code);\r\n            $(this).hide();\r\n            $(ths).val($(ths).attr(\'prompt\'));\r\n            $(ths).removeClass(\'aktif\');\r\n        });\r\n    });\r\n    $(\'.cinarChooser\').focus(function () {\r\n        if(!$(this).attr(\'data-id\')) $(this).val(\"\");\r\n        $(this).addClass(\'aktif\');\r\n \r\n        if ($(this).val() == $(this).attr(\'prompt\')) $(this).val(\"\");\r\n    });\r\n    $(\'.cinarChooser\').blur(function () {\r\n        if ($(\'.cinarChooserList:hover\').length == 0 && $(\'.cinarChoserOkBtn:hover\').length == 0) {\r\n            $(this).val($(this).attr(\'prompt\'));\r\n            $(this).removeClass(\'aktif\');\r\n \r\n            var id = $(this).attr(\"id\") + \"List\";\r\n            var divList = $(\"#\" + id);\r\n            divList.remove();\r\n \r\n            $(this).parent().find(\'.cinarChoserOkBtn\').hide();\r\n        }\r\n    });\r\n    $(\'.cinarChooser\').keydown(function (event) {\r\n        var ths = this;\r\n        var id = $(ths).attr(\"id\") + \"List\";\r\n        var divList = $(\"#\" + id);\r\n \r\n        if (divList.find(\'div\').length > 0) {\r\n            switch (event.which) {\r\n                case 13:\r\n                    selectOption(ths, divList, divList.find(\'.selected\'));\r\n                    event.preventDefault();\r\n                    return false;\r\n                case 38: // up\r\n                    var elm = divList.find(\'.selected\');\r\n                    if (elm.length == 0)\r\n                        divList.find(\'div:last\').addClass(\"selected\");\r\n                    else {\r\n                        elm.removeClass(\"selected\");\r\n                        elm.prev().addClass(\'selected\');\r\n                    }\r\n                    event.preventDefault();\r\n                    return false;\r\n                case 40:\r\n                    var elm = divList.find(\'.selected\');\r\n                    if (elm.length == 0)\r\n                        divList.find(\'div:first\').addClass(\"selected\");\r\n                    else {\r\n                        elm.removeClass(\"selected\");\r\n                        elm.next().addClass(\'selected\');\r\n                    }\r\n                    event.preventDefault();\r\n                    return false;\r\n            }\r\n        }\r\n \r\n        if (event.which == 13 && $(ths).attr(\'data-id\')) {\r\n            $(ths).parent().find(\'.cinarChoserOkBtn\').click();\r\n            event.preventDefault();\r\n            $(ths).blur();\r\n            return false;\r\n        }\r\n    });\r\n \r\n    $(\'.cinarChooser\').keyup(function (event) {\r\n        var ths = this;\r\n        var id = $(ths).attr(\"id\") + \"List\";\r\n        var divList = $(\"#\" + id);\r\n \r\n        if ($(this).val().length <= 2) {\r\n            divList.remove();\r\n            return;\r\n        }\r\n \r\n        switch (event.which) {\r\n            case 13:\r\n            case 40:\r\n            case 38: // up\r\n                event.preventDefault();\r\n                return false;\r\n        }\r\n \r\n        var templateHtml = $(\'#\' + $(ths).attr(\'id\') + \'Template\').html();\r\n        var templateCallback = eval($(ths).attr(\'templateCallback\') || \"(function(item){return item.Name;})\");\r\n \r\n        getNamedEntityListByKeyword($(this).attr(\'entityName\'), $(this).val(), function (list) {\r\n            if (list.length == 0) {\r\n                divList.remove();\r\n               return;\r\n            }\r\n \r\n            if (divList.length == 0) {\r\n                divList = $(\'<div id=\"\' + id + \'\" class=\"cinarChooserList\"></div>\');\r\n                divList.appendTo($(ths).parent());\r\n            }\r\n \r\n            var allHtml = \'\';\r\n            for (var i = 0; i < list.length && i<16; i++) {\r\n                if(templateHtml){\r\n                    var html = templateHtml;\r\n                    for (var key in list[i]) {\r\n                        html = html.replace(\'{{\' + key + \'}}\', list[i][key]);\r\n                    }\r\n                    allHtml += \'<div eId=\"\' + list[i].Id + \'\">\' + html + \'</div>\';\r\n                }\r\n                else {\r\n                    allHtml += \'<div eId=\"\' + list[i].Id + \'\">\' + templateCallback(list[i]) + \'</div>\';\r\n                }\r\n                    \r\n            }\r\n \r\n            divList.html(\'\');\r\n            divList.append(allHtml);\r\n \r\n            divList.find(\'div\').click(function () { selectOption(ths, divList, $(this));  });\r\n        });\r\n \r\n    });\r\n    function selectOption(cinarChooser, divList, elm) {\r\n        divList.remove();\r\n        $(cinarChooser).val($(elm).text());\r\n        $(cinarChooser).attr(\'data-id\', $(elm).attr(\'eId\'));\r\n        //$(cinarChooser).focus();\r\n        if($(cinarChooser).attr(\'immediate\'))\r\n            $(cinarChooser).parent().find(\'.cinarChoserOkBtn\').click();\r\n        else\r\n            $(cinarChooser).parent().find(\'.cinarChoserOkBtn\').show();\r\n    }\r\n});\r\n \r\nfunction getNamedEntityListByKeyword(entityName, q, callback){\r\n    readEntityList(entityName, \'Namelike\'+q+\'%\', function(entityList){\r\n        if(entityList && entityList.length>0)\r\n            callback(entityList);\r\n        else\r\n            readEntityList(entityName, \'Namelike%\'+q+\'%\', function(entityList){\r\n                callback(entityList);\r\n            }, \'Name\');\r\n   }, \'Name\');\r\n}\r\n\r\nfunction showNotifications(){\r\n    var not = $(\'#notifications\');\r\n    var news = user.Notifications.findAll(function(n){return n.Visible;});\r\n    if(news.length>0) {\r\n        not.prev().find(\'.badge\').show().text(news.length);\r\n        not.prev().find(\'.icon-bell-alt\').addClass(\'icon-animated-bell\');\r\n    }\r\n    for(var i=0; i < user.Notifications.length;i++){\r\n        var n = user.Notifications[i];\r\n        not.find(\':first\').after(\r\n            \'<li class=\"\'+(n.Visible ? \"new\":\"\")+\'\">\' + \r\n            $(\'#notTemplate\').html()\r\n                .replace(\'{{link}}\',getNotificationLinkOf(n))\r\n                .replace(\'{{text}}\',getNotificationTextOf(n))\r\n                .replace(\'{{name}}\',n.Name)\r\n                .replace(\'{{avatar}}\',n.Avatar)\r\n                .replace(\'{{id}}\',n.Id)\r\n                .replace(\'{{time}}\', prettyDate(n.InsertDate)) + \r\n            \'</li>\'\r\n        );\r\n    }\r\n}\r\nfunction goToNotification(a, id){\r\n    a = $(a);\r\n    var link = a.attr(\'link\');\r\n    saveEntity(\'GenericNotification\', {Id:id, Visible:0}, function(){\r\n        location.href = link;\r\n    });\r\n}\r\nfunction getNotificationLinkOf(n){\r\n    switch(n.RelatedEntityName){\r\n        case \"Task\":\r\n            return \'/IssueTaskView.aspx?eId=\' + n.RelatedEntityId;\r\n        case \"Project\":\r\n            return \'/IssueProjectView.aspx?eId=\' + n.RelatedEntityId;\r\n        case \"Company\":\r\n            return \'/CrmCompanyView.aspx?eId=\' + n.RelatedEntityId;\r\n        case \"Contact\":\r\n            return \'/CrmContactView.aspx?eId=\' + n.RelatedEntityId;\r\n    }\r\n    return \'\';\r\n}\r\nfunction getNotificationTextOf(n){\r\n    var res = \'\';\r\n    \r\n    if(n.EntityName.indexOf(\'Comment\')>-1)\r\n        res = \'comments:<br/> \' + n.Display + \' &nbsp; \' + getIconForEntity(n.EntityName);\r\n        \r\n    switch(n.RelatedEntityName){\r\n        case \"Task\":\r\n            res = \'updated task: <br/>\' + n.Display; break;\r\n        case \"Project\":\r\n            res = \'assigned to you: <br/>\' + n.Display; break;\r\n        case \"Company\":\r\n            res = \'assigned to you: <br/>\' + n.Display; break;\r\n        case \"Contact\":\r\n            res = \'assigned to you: <br/>\' + n.Display; break;\r\n    }\r\n    if(res) res += \' &nbsp; \' + getIconForEntity(n.RelatedEntityName);\r\n    return res;\r\n}\r\n\r\nfunction getIconForEntity(entityName){\r\n    if(entityName.indexOf(\'Comment\')>-1)\r\n        return \'<i class=\"icon-comment blue\"></i>\';\r\n        \r\n    switch(entityName){\r\n        case \"Task\":\r\n            return \'<i class=\"icon-check red\"></i>\';\r\n        case \"Project\":\r\n            return \'<i class=\"icon-briefcase orange\"></i>\';\r\n        case \"Company\":\r\n            return \'<i class=\"icon-fire green\"></i>\';\r\n        case \"Contact\":\r\n            return \'<i class=\"icon-user blue\"></i>\';\r\n    }\r\n    return \'\';    \r\n}\r\n\r\nfunction showTasks(){\r\n    var not = $(\'#tasks\');\r\n    var news = user.Tasks.findAll(function(n){return n.Status==\'New\';});\r\n    if(news.length>0)\r\n        not.prev().find(\'.badge\').show().text(news.length);\r\n    for(var i=0; i < user.Tasks.length;i++){\r\n        var n = user.Tasks[i];\r\n        not.find(\':first\').after(\r\n            \'<li class=\"\'+(n.Status==\'New\' ? \"new\":\"\")+\'\">\' + \r\n            $(\'#taskTemplate\').html()\r\n                .replace(\'{{link}}\',\'/IssueTaskView.aspx?eId=\'+n.Id)\r\n                .replace(\'{{name}}\',n.Name.length>60 ? n.Name.substr(0,57)+\'...\' : n.Name)\r\n                .replace(\'{{percent}}\',n.Percent)\r\n                .replace(\'{{percent}}\',n.Percent)\r\n                .replace(\'{{status}}\',n.Status)\r\n                .replace(\'{{id}}\',n.Id)\r\n                .replace(\'{{timing}}\', n.Timing) +