atar}}\',post.Avatar || \'/UserFiles/user.jpg\');\r\n    str = str.replace(\'{{Name}}\', post.Name);\r\n    str = str.replace(\'{{Prompt}}\', post.Type==\"Comment\" ? \"commented: \" : ((post.Type==\'Update\' ? \" updated a \" : \" added new \") + post.EntityName));\r\n    str = str.replace(\'{{Title}}\', post.Title);\r\n    str = str.replace(\'{{Icon}}\', getIconForEntity(post.EntityName));\r\n    str = str.replace(\'{{Time}}\', post.Time);\r\n    str = str.replace(\'{{Details}}\', post.Type==\'Insert\' ? \'\' : post.Details);\r\n    str = str.replace(\'{{ViewLink}}\', getLastActivityViewLink(post));\r\n    //str = str.replace(\'{{EditLink}}\', getLastActivityViewLink(post).replace(\'View\', \'Edit\'));\r\n\r\n    str = \'<div class=\"timeline-item clearfix\" date=\"\'+post.InsertDate+\'\">\'+str+\'</div>\';\r\n    \r\n    return str;\r\n}\r\n\r\nfunction getLastActivityViewLink(post){\r\n    var prefix = \'/Crm\';\r\n    if(post.EntityName==\'Task\' || post.EntityName==\'Project\')\r\n        prefix = \'/Issue\';\r\n	return prefix + post.EntityName + \'View.aspx?eId=\' + post.EntityId;\r\n}\r\n\r\nfunction appendPostsToStreamBottom(posts){\r\n    var stream = jQuery(\'.timeline-container\');\r\n\r\n    posts.each(function(post){\r\n		var tarihDiv = stream.find(\'.timeline-label[date=\"\'+post.Name+\'\"]\');\r\n		if(tarihDiv.length==0){\r\n			stream.append(\'<div class=\"timeline-label\" date=\"\'+post.Name+\'\"><span class=\"label label-primary arrowed-in-right label-lg\"><b>\'+post.Name+\'</b></span></div><div class=\"timeline-items\"></div>\');\r\n			tarihDiv = stream.find(\'.timeline-label[date=\"\'+post.Name+\'\"]\');\r\n		}\r\n		var items = tarihDiv.next();\r\n		post.Activities.each(function(act){\r\n			items.append(getPostHtml(act));\r\n		});\r\n    });\r\n}','','',1,'dd MMMM yyyy','',90,960,'info@example.com','mail.example.com',25,'','','False',15,'Default.aspx','Category.aspx','Content.aspx','Login.aspx','Membership.aspx','Profile.aspx','RememberPassword.a