INSERT INTO `module` VALUES (50,'Login.aspx','Content',0,'LoginForm2','','Cinar.CMS.Serialization\nInnerHtml,1495,$\r\nif (Provider.Session[\'loginError\'])\r\n{\r\n    echo(\'<p class=\"text-danger\">\' + Provider.Session[\'loginError\'] + \'</p>\');\r\n	Provider.Session.Remove(\'loginError\');\r\n}\r\n$\r\n<form accept-charset=\"UTF-8\" role=\"form\" id=\"fLogin\" method=\"post\" action=\"DoLogin.ashx\">\r\n	<input type=\"hidden\" name=\"RedirectURL\" value=\"$=Provider.Request.RedirectURL ? Provider.Server.HtmlEncode(Provider.Request.RedirectURL) : Provider.Configuration.MainPage$\"/>\r\n	<fieldset>\r\n		<label class=\"block clearfix\">\r\n			<span class=\"block input-icon input-icon-right\">\r\n				<input type=\"text\" id=\"username\" name=\"Email\" class=\"form-control\" placeholder=\"E-mail\"/>\r\n				<i class=\"icon-user\"></i>\r\n			</span>\r\n		</label>\r\n\r\n		<label class=\"block clearfix\">\r\n			<span class=\"block input-icon input-icon-right\">\r\n				<input type=\"password\" id=\"pass\" class=\"form-control\" placeholder=\"Password\" name=\"Passwd\" />\r\n				<i class=\"icon-lock\"></i>\r\n			</span>\r\n		</label>\r\n\r\n		<div class=\"checkbox\">\r\n	    	<label>\r\n	    		<input name=\"RememberMe\" type=\"checkbox\" value=\"1\"> Remember Me\r\n	    	</label>\r\n	    </div>\r\n		\r\n		<div class=\"space\"></div>\r\n\r\n		<div class=\"clearfix\">\r\n			<button type=\"submit\" class=\"width-35 pull-right btn btn-sm btn-primary\" id=\"login\">\r\n				<i class=\"icon-key\"></i>\r\n				Login\r\n			</button>\r\n		</div>\r\n\r\n		<div class=\"space-4\"></div>\r\n	</fieldset>\r\n</form>\r\n\r\n<script>\r\n    \\$(function(){\r\n        if(getCookie(\'keyword\'))\r\n            \\$(\'input[name=RememberMe]\').prop(\'checked\', true);\r\n    });\r\n</script>Id,2,50Template,10,Login.aspxRegion,7,ContentOrderNo,1,0Name,10,LoginForm2CSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,3,rowVisible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0ElementName,3,divElementId,0,',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(55,'Default.aspx','navbar',0,'StaticHtml','.dropdown-navbar .msg-photo {\r\n    vertical-align: top;\r\n}\r\n.dropdown-navbar .msg-body {\r\n    max-width: 350px !important;\r\n}','Cinar.CMS.Serialization\nInnerHtml,3948,    <div class=\"navbar-header pull-left\">\r\n		<a href=\"/\" class=\"navbar-brand\">\r\n			<small>\r\n				<img src=\"/UserFiles/_design/logo.png\" class=\"msg-photo\" style=\"width: 33px;position: absolute;top: 6px;\" />\r\n				&nbsp; &nbsp; &nbsp; &nbsp; $=Provider.Configuration.SiteName$\r\n			</small>\r\n		</a><!-- /.brand -->\r\n	</div><!-- /.navbar-header -->\r\n\r\n	<div class=\"navbar-header pull-right\" role=\"navigation\">\r\n		<ul class=\"nav ace-nav\">\r\n			<li class=\"grey\">\r\n				<a data-toggle=\"dropdown\" class=\"dropdown-toggle\" href=\"#\">\r\n					<i class=\"icon-tasks\"></i>\r\n					<span class=\"badge badge-grey\" style=\"display:none\">4</span>\r\n				</a>\r\n\r\n				<ul id=\"tasks\" class=\"pull-right dropdown-navbar dropdown-menu dropdown-caret dropdown-close\">\r\n					<li class=\"dropdown-header\">\r\n						<i class=\"icon-ok\"></i>\r\n						Tasks to complete\r\n					</li>\r\n\r\n					<li style=\"display:none\" id=\"taskTemplate\">\r\n						<a link=\"{{link}}\" onclick=\"location.href=\'/IssueTaskView.aspx?eId={{id}}\';\">\r\n							<div class=\"clearfix\">\r\n								<span class=\"pull-left\">{{name}}</span>\r\n								<span class=\"pull-right\">{{percent}}%</span>\r\n							</div>\r\n\r\n							<div class=\"progress progress-mini\" data-percent=\"{{timing}}\">\r\n								<div style=\"width:{{percent}}%\" class=\"progress-bar {{status}}\"></div>\r\n							</div>\r\n						</a>\r\n					</li>\r\n\r\n					<li>\r\n						<a href=\"/IssueTasks.aspx?AssignedToId=$=Provider.User.Id$\">\r\n							See tasks with details\r\n							<i class=\"icon-arrow-right\"></i>\r\n						</a>\r\n					</li>\r\n				</ul>\r\n			</li>\r\n\r\n			<li class=\"green\">\r\n				<a data-toggle=\"dropdown\" class=\"dropdown-toggle\" href=\"#\">\r\n					<i class=\"icon-bell-alt\"></i>\r\n					<span class=\"badge badge-success\" style=\"display:none\">5</span>\r\n				</a>\r\n\r\n				<ul id=\"notifications\" class=\"pull-right dropdown-navbar dropdown-menu dropdown-caret dropdown-close\">\r\n					<li class=\"dropdown-header\">\r\n						<i class=\"icon-bell-alt\"></i>\r\n						Notifications\r\n					</li>\r\n\r\n					<li style=\"display:none\" id=\"notTemplate\">\r\n						<a link=\"{{link}}\" onclick=\"goToNotification(this, {{id}})\">\r\n							<img src=\"{{avatar}}\" class=\"msg-photo\" />\r\n							<span class=\"msg-body\">\r\n								<span class=\"msg-title\">\r\n									<span class=\"blue\">{{name}}</span>\r\n									{{text}}\r\n								</span>\r\n\r\n								<span class=\"msg-time\">\r\n									<i class=\"icon-time\"></i>\r\n									<span>{{time}}</span>\r\n								</span>\r\n							</span>\r\n						</a>\r\n					</li>\r\n\r\n					<li>\r\n						<a href=\"/Timeline.aspx\">\r\n							See all timeline\r\n							<i class=\"icon-arrow-right\"></i>\r\n						</a>\r\n					</li>\r\n				</ul>\r\n			</li>\r\n\r\n			<li class=\"light-blue\">\r\n				<a data-toggle=\"dropdown\" href=\"#\" class=\"dropdown-toggle\">\r\n					<img class=\"nav-user-photo\" src=\"$=Provider.User.Avatar ? Provider.User.Avatar : \'/UserFiles/assets/avatars/user.jpg\'$\" alt=\"$=Provider.User.Name$\'s Photo\" />\r\n					<span class=\"user-info\">\r\n						<small>Welcome<br/> <b>$=Provider.User.Nick$</b></small>\r\n						\r\n					</span>\r\n\r\n					<i class=\"icon-caret-down\"></i>\r\n				</a>\r\n\r\n				<ul class=\"user-menu pull-right dropdown-menu dropdown-yellow dropdown-caret dropdown-close\">\r\n                $\r\n                if(Provider.User.IsInRole(\'Designer\')){\r\n                $\r\n    				<li>\r\n						<a href=\"?DesignMode=$=Provider.DesignMode ? \'Off\':\'On\'$\">\r\n							<i class=\"icon-check$=Provider.DesignMode ? \'-empty\':\'\'$\"></i>\r\n							$