             LEFT JOIN Task t ON t.Id=n.EntityId AND n.EntityName=\'Task\'\r\n                        LEFT JOIN Project p ON p.Id=n.EntityId AND n.EntityName=\'Project\'\r\n                    	LEFT JOIN EntityComment ec ON ec.Id=n.EntityId AND n.EntityName=\'EntityComment\'\r\n                    	LEFT JOIN Contact c ON c.Id=n.EntityId AND n.EntityName=\'Contact\'\r\n                    	LEFT JOIN Company co ON co.Id=n.EntityId AND n.EntityName=\'Company\'\r\n                    where \r\n                        n.UserId=\"+Provider.User.Id+\" order by n.Id desc limit 10\");\r\n                        \r\n    var tasks = Provider.Database.GetDataTable(\r\n                    \"select \r\n                        Id,\r\n                        Name,\r\n                        Status,\r\n                        StartDate,\r\n                        DueDate,\r\n                        \'\' as Timing,\r\n                        round((now()-StartDate)/(DueDate-StartDate)*100) as Percent\r\n                    from\r\n                        Task\r\n                    where\r\n                        AssignedToId=\"+Provider.User.Id+\" AND Status<>\'Completed\' AND Status<>\'Rejected\' order by Id desc limit 10\");\r\n    if(tasks)\r\n    foreach(var dr in tasks.Rows){\r\n        dr.Timing = Utility.ToStringSpan(dr.StartDate, dr.DueDate, \'MMMM\');\r\n        if(dr.Percent>100) dr.Percent = 100;\r\n    }\r\n    $\r\n    user.Notifications = $=nots==null ? \"[]\" : Utility.ToJSON(nots.Rows)$.reverse();\r\n    user.Tasks = $=tasks==null ? \"[]\" : Utility.ToJSON(tasks.Rows)$.reverse();\r\n</script>BottomHtml,0,ParentModuleId,1,0CSSClass,26,navbar-container containerVisible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0ElementId,16,navbar-containerElementName,3,div',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'navbar-container','div'),(57,'Default.aspx','sidebar',0,'StaticHtml','','Cinar.CMS.Serialization\nInnerHtml,1124,<div class=\"sidebar-shortcuts-large\" id=\"si