ountryId\r\n                left join Definition d2 ON d2.Id=c.SectorId\r\n                left join User u ON u.Id=c.UserId\r\n            where\r\n                1=1\";\r\n\r\nif(Provider.Request.CountryId>0)\r\n    sql += \" AND c.CountryId = \" + Int32.Parse(Provider.Request.CountryId);\r\nif(Provider.Request.UserId>0)\r\n    sql += \" AND c.UserId = \" + Int32.Parse(Provider.Request.UserId);\r\nif(Provider.Request.SectorId>0)\r\n    sql += \" AND c.SectorId = \" + Int32.Parse(Provider.Request.SectorId);\r\nif(Provider.Request.Tags)\r\n    sql += \" AND c.Tags like \'%\" + Provider.Request.Tags + \"%\'\";\r\nif(Provider.Request.Sponsorship)\r\n    sql += \" AND c.ExtraField1 = \'yes\'\";\r\n    \r\nsql += \" limit 100\";\r\n    \r\n//echo(\'<pre>\'+sql+\'</pre>\');\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"green\">\r\n        <i class=\"icon-fire\"></i>\r\n		Companies\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			Sectoral database\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<h4 class=\"header smaller lighter red\" style=\"margin-left:10px\">Filter</h4>\r\n<form method=\"post\" action=\"CrmCompany.aspx\">\r\n    <div class=\"col-xs-6 col-sm-2\">\r\n        <select id=\"CountryId\" name=\"CountryId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Select country</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Definition where Kind=\'Country\' order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.CountryId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n	<div class=\"col-xs-6 col-sm-2\">\r\n        <select id=\"UserId\" name=\"UserId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Select user</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User where Id<>2 order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.UserId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n\r\n	<div class=\"col-xs-6 col-sm-2\">\r\n        <select id=\"SectorId\" name=\"SectorId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Select sector</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Definition where Kind=\'Sector\' order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.SectorId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n\r\n    <div class=\"col-xs-6 col-sm-2\">\r\n        <select id=\"Tags\" name=\"Tags\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"\">Select tag</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Definition where Kind=\'CompanyTag\' order by Name\").Rows)\r\n                echo(\'<option\'+((Provider.Request.Tags??\"\").Contains(dr.Name) ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n\r\n    <label class=\"col-xs-6 col-sm-2\">\r\n		SP: <input name=\"Sponsorship\" id=\"Sponsorship\" class=\"ace ace-switch ace-switch-5\" value=\"yes\" type=\"checkbox\">\r\n		<span class=\"lbl\"></span>\r\n	</label>\r\n    \r\n    <div class=\"col-sm-2\">\r\n        <button type=\"submit\" class=\"btn btn-xs btn-success\">\r\n			Filter\r\n			<i class=\"icon-arrow-right icon-on-right bigger-110\"></i>\r\n		</button>\r\n    </div>\r\n</form>\r\n<br/><br/>\r\n\r\n<div class=\"table-responsive\">\r\n    <div id=\"table-storage_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n        <table id=\"table-entity\" class=\"table table-striped table-bordered table-hover dataTable\" aria-describedby=\"table-storage_info\">\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \\$(function(){\r\n        var dt = $=Utility.ToJSON(Provider.Database.GetDataTable(sql))$;\r\n        bindTable({\r\n              list: dt.rows,\r\n              tableId: \"#table-entity\",\r\n              columns: [\r\n                  {\r\n                      \"mData\": \"Name\",\r\n                      \"sTitle\": \"Company Name\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a href=\"/CrmCompanyView.aspx?eId=\'+full.Id+\'\">\'+full.Name+\'</a>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Country\",\r\n                      \"sTitle\": \"Country\"\r\n                  },\r\n                  /*\r\n                  {\r\n                      \"mData\": \"UserName\",\r\n                      \"sTitle\": \"Hazar Contact\"\r\n                  },\r\n                  */\r\n                  {\r\n                      \"mData\": \"Sector\",\r\n                      \"sTitle\": \"Sector\"\r\n                  },\r\n                  /*\r\n                  {\r\n                      \"mData\": \"ExtraField1\",\r\n                      \"sTitle\": \"Sp\"\r\n                  },\r\n                  */\r\n                  {\r\n                      \"mData\": null,\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a class=\"green\" href=\"/$=editPage$?eId=\'+full.Id+\'\"><i class=\"icon-pencil bigger-130\"></i></a> &nbsp; \' +\r\n                                  \'<a class=\"red\" href=\"#\"><i class=\"icon-trash bigger-130\" ></i></a>\';\r\n                      }\r\n                  }\r\n              ]\r\n          });\r\n    });\r\n    \r\n</script>\r\n\r\n<div class=\"clearfix form-actions\">\r\n    <button class=\"btn btn-xs btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/$=editPage$\';\">\r\n    	<i class=\"icon-plus bigger-110\"></i>\r\n		Add New\r\n	</button>\r\n    <button style=\"margin-right:16px\" class=\"btn btn-xs btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/CrmCompanyToExcel.aspx\';\">\r\n		<i class=\"icon-external-link bigger-110\"></i>\r\n		Export to Excel\r\n	</button>\r\n</div>\r\nId,2,99ElementName,3,divElementId,0,Template,15,CrmCompany.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,0,Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(100,'CrmCompany.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,100ElementName,3,divElementId,0,Template,15,CrmCompany.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(101,'CrmCompany.aspx','sidebar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,7,sidebarId,3,101ElementName,3,divElementId,0,Template,15,CrmCompany.aspxRegion,7,sidebarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,