padding-right\" for=\"Name\"> Name </label>\r\n        		<div class=\"col-sm-9\">\r\n        			<input type=\"text\" id=\"Name\" name=\"Name\" placeholder=\"\" class=\"col-sm-8\" />\r\n        		</div>\r\n        	</div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n\r\n            <div class=\"form-group\">\r\n                <label class=\"col-sm-3 control-label no-padding-right\" for=\"Email\"> Email </label>\r\n                <div class=\"col-sm-9\">\r\n    			    <input type=\"text\" id=\"Email\" name=\"Email\" placeholder=\"\" class=\"col-sm-6\"/>\r\n                </div>\r\n        	</div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n\r\n            <div class=\"form-group\">\r\n                <label class=\"col-sm-3 control-label no-padding-right\" for=\"Web\"> Web </label>\r\n                <div class=\"col-sm-9\">\r\n    			    <input type=\"text\" id=\"Web\" name=\"Web\" placeholder=\"\" class=\"col-sm-6\"/>\r\n                </div>\r\n        	</div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n            \r\n            <div class=\"form-group\">\r\n                <label class=\"col-sm-3 control-label no-padding-right\" for=\"Phone\">\r\n            		Phone\r\n            	</label>\r\n            \r\n            	<div class=\"col-sm-9 input-group\">\r\n            		<span class=\"input-group-addon\">\r\n            			<i class=\"icon-phone\"></i>\r\n            		</span>\r\n            		<input class=\"input-mask-phone\" type=\"text\" id=\"Phone\" name=\"Phone\">\r\n            	</div>\r\n            </div>            \r\n        \r\n            <div class=\"space-4\"></div>\r\n            \r\n            <div class=\"form-group\">\r\n                <label class=\"col-sm-3 control-label no-padding-right\" for=\"Phone2\">\r\n                	Phone 2\r\n            	</label>\r\n            \r\n            	<div class=\"col-sm-9 input-group\">\r\n            		<span class=\"input-group-addon\">\r\n       