        where\r\n                1=1\";\r\n\r\nif(Provider.Request.CompanyId>0)\r\n    sql += \" AND c.CompanyId = \" + Int32.Parse(Provider.Request.CompanyId);\r\nif(Provider.Request.UserId>0)\r\n    sql += \" AND c.UserId = \" + Int32.Parse(Provider.Request.UserId);\r\nif(Provider.Request.Tags)\r\n    sql += \" AND c.Tags like \'%\" + Provider.Request.Tags + \"%\'\";\r\nif(Provider.Request.NewsletterMembership)\r\n    sql += \" AND c.NewsletterMembership = 1\";\r\nif(Provider.Request.HazarWorld)\r\n    sql += \" AND c.ExtraField1 > \'0\'\";\r\nif(Provider.Request.CaspianReport)\r\n    sql += \" AND c.ExtraField2 > \'0\'\";\r\n    \r\nsql += \" limit 100\";\r\n    \r\n//echo(\'<pre>\'+sql+\'</pre>\');\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"blue\">\r\n        <i class=\"icon-user\"></i>\r\n		Contacts\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			The people\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<h4 class=\"header smaller lighter red\" style=\"margin-left:10px\">Filter</h4>\r\n<form method=\"post\" action=\"CrmContacts.aspx\">\r\n    <div class=\"col-sm-2\">\r\n        <!--select id=\"CompanyId\" name=\"CompanyId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Select company</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Company order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.CompanyId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select-->\r\n        <input type=\"hidden\" name=\"CompanyId\" id=\"CompanyId\" value=\"0\"/>\r\n    	<input type=\"text\" placeholder=\"Select company\" class=\"width-100 cinarChooser\" \r\n            entityName=\"Company\" \r\n            id=\"CompanyChooser\" \r\n            selectedCallback=\"onCompanySelect\"\r\n            templateCallback=\"onWriteCompanyItem\"\r\n            immediate=\'true\'\r\n            autocomplete=\"off\" />        \r\n        <script>\r\n            function onCompanySelect(id, name){\r\n                \\$(\'#CompanyId\').val(id);\r\n            }\r\n            function onWriteCompanyItem(item){\r\n                return \'<img height=\"40\" src=\"\'+(item.Picture ? item.Picture:\'/UserFiles/company.png\')+\'\"/> \' + item.Name;\r\n            }\r\n        </script>\r\n    </div>\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"UserId\" name=\"UserId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Select user</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User where Id<>2 order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.UserId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n\r\n    <div class=\"col-xs-6 col-sm-2\">\r\n        <select id=\"Tags\" name=\"Tags\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"\">Select tag</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Definition where Kind=\'CompanyTag\' order by Name\").Rows)\r\n                echo(\'<option\'+((Provider.Request.Tags??\"\").Contains(dr.Name) ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    \r\n    <div class=\"col-sm-5\">\r\n    <label class=\"col-sm-4\">\r\n    	NM: <input name=\"NewsletterMembership\" id=\"NewsletterMembership\" class=\"ace ace-switch ace-switch-5\" value=\"1\" type=\"checkbox\">\r\n		<span class=\"lbl\"></span>\r\n	</label>\r\n\r\n    <label class=\"col-sm-4\">\r\n    	HW: <input name=\"HazarWorld\" id=\"HazarWorld\" class=\"ace ace-switch ace-switch-5\" value=\"1\" type=\"checkbox\">\r\n		<span class=\"lbl\"></span>\r\n	</label>\r\n\r\n    <label class=\"col-sm-4\">\r\n    	CR: <input name=\"CaspianReport\" id=\"CaspianReport\" class=\"ace ace-switch ace-switch-5\" value=\"1\" type=\"checkbox\">\r\n		<span class=\"lbl\"></span>\r\n	</label>\r\n    </div>\r\n    \r\n    <div class=\"col-sm-1\">\r\n        <button type=\"submit\" class=\"btn btn-xs btn-success\">\r\n			Filter\r\n			<i class=\"icon-arrow-right icon-on-right bigger-110\"></i>\r\n		</button>\r\n    </div>\r\n</form>\r\n<br/><br/>\r\n\r\n<div class=\"table-responsive\">\r\n    <div id=\"table-storage_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n        <table id=\"table-entity\" class=\"table table-striped table-bordered table-hover dataTable\" aria-describedby=\"table-storage_info\">\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \\$(function(){\r\n        var dt = $=Utility.ToJSON(Provider.Database.GetDataTable(sql))$;\r\n        bindTable({\r\n              list: dt.rows,\r\n              tableId: \"#table-entity\",\r\n              columns: [\r\n                  {\r\n                      \"mData\": \"Name\",\r\n                      \"sTitle\": \"Contact Name\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a href=\"/CrmContactView.aspx?eId=\'+full.Id+\'\">\'+full.Name+\'</a>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Email\",\r\n                      \"sTitle\": \"Email\"\r\n                  },\r\n                  {\r\n                      \"mData\": \"Company\",\r\n                      \"sTitle\": \"Company\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          if(!full.Company)\r\n                            return \'\';\r\n                          return full.Company.length>20 ? full.Company.substring(0,20)+\'...\' : full.Company;\r\n                      }\r\n                  },\r\n                  /*\r\n                  {\r\n                      \"mData\": \"NewsletterMembership\",\r\n                      \"sTitle\": \"NM\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return data ? \"Yes\" : \"No\";\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"ExtraField1\",\r\n                      \"sTitle\": \"HW\"\r\n                  },\r\n                  {\r\n                      \"mData\": \"ExtraField2\",\r\n                      \"sTitle\": \"CR\"\r\n                  },\r\n                  */\r\n                  {\r\n                      \"mData\": null,\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a class=\"green\" href=\"/$=editPage$?eId=\'+full.Id+\'\"><i class=\"icon-pencil bigger-130\"></i></a> &nbsp; \' +\r\n                                  \'<a class=\"red\" href=\"#\"><i class=\"icon-trash bigger-130\" ></i></a>\';\r\n                      }\r\n                  }\r\n              ]\r\n          });\r\n    });\r\n    \r\n</script>\r\n\r\n<div class=\"clearfix form-actions\">\r\n    Invite selected contacts to \r\n        <select id=\"EventId\" name=\"EventId\" style=\"width:200px\">\r\n            <option value=\"0\"></option>\r\n        </select>\r\n        <button class=\"btn btn-xs btn-success\" onclick=\"alert(ajax({url:\'/Handler.aspx?method=invite&EventId=\'+\\$(\'#EventId\').val()+\'&\'+\\$(\'form\').serialize(),isJSON:false, noCache:true}))\">\r\n            Invite\r\n            <i class=\"icon-arrow-right icon-on-right bigger-110\"></i>\r\n        </button>\r\n    <script>\r\n        \\$(function(){\r\n            fillSelectOptions(\'#EventId\', \'Event\', \'EventDate>@Yesterday\');\r\n        });\r\n    </script>\r\n        \r\n        \r\n    <button class=\"btn btn-xs btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/$=editPage$\';\">\r\n		<i class=\"icon-plus bigger-110\"></i>\r\n		Add New\r\n	</button>\r\n    <button style=\"margin-right:16px\" class=\"btn btn-xs btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/CrmContactsToExcel.aspx\';\">\r\n		<i class=\"icon-external-link bigger-110\"></i>\r\n		Export to Excel\r\n	</button>\r\n</div>\r\nId,3,107ElementName,3,divElementId,0,Template,16,CrmContacts.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,0,Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(108,'CrmContacts.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,108ElementName,3,divElementId,0,Template,16,CrmContacts.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(109,'CrmContacts.aspx','sidebar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,7,sidebarId,3,109ElementName,3,divElementId,0,Template,16,CrmContacts.aspxRegion,7,sidebarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(11