,\r\n                Location,\r\n                EventTime\r\n            from\r\n                Event\r\n            where\r\n                1=1\";\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"pink\">\r\n        <i class=\"icon-film\"></i>\r\n		Events\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			The activities\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n\r\n<div class=\"table-responsive\">\r\n    <div id=\"table-storage_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n        <table id=\"table-entity\" class=\"table table-striped table-bordered table-hover dataTable\" aria-describedby=\"table-storage_info\">\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \\$(function(){\r\n        var dt = $=Utility.ToJSON(Provider.Database.GetDataTable(sql))$;\r\n        bindTable({\r\n              list: dt.rows,\r\n              tableId: \"#table-entity\",\r\n              columns: [\r\n                  {\r\n                      \"mData\": \"Name\",\r\n                      \"sTitle\": \"Event Name\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a href=\"/CrmEventView.aspx?eId=\'+full.Id+\'\">\'+full.Name+\'</a>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Location\",\r\n                      \"sTitle\": \"Location\"\r\n                  },\r\n                  {\r\n                      \"mData\": \"EventDate\",\r\n                      \"sTitle\": \"Date\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return data.replace(\'T00:00:00\',\'\');\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"EventTime\",\r\n                      \"sTitle\": \"Time\"\r\n                  },\r\n                  {\r\n                      \"mData\": null,\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a class=\"green\" href=\"/$=editPage$?eId=\'+full.Id+\'\"><i class=\"icon-pencil bigger-130\"></i></a> &nbsp; \' +\r\n                                  \'<a class=\"red\" href=\"#\"><i class=\"icon-trash bigger-130\" ></i></a>\';\r\n                      }\r\n                  }\r\n              ]\r\n          });\r\n    });\r\n    \r\n</script>\r\n\r\n<div class=\"clearfix form-actions\">\r\n    <div class=\"text-right\">\r\n		<button class=\"btn btn-info\" type=\"button\" onclick=\"location.href=\'/$=editPage$\';\">\r\n			<i class=\"icon-add bigger-110\"></i>\r\n			Add New\r\n		</button>\r\n	</div>\r\n</div>\r\nId,3,115ElementName,3,divElementId,0,Template,14,CrmEvents.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,0,Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(116,'CrmEvents.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,116ElementName,3,divElementId,0,Template,14,CrmEvents.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'