ff\">\r\n<input type=\"hidden\" name=\"cmdName\" value=\"save\"/>\r\n<input type=\"hidden\" name=\"Id\" value=\"$=id ?? 0$\"/>\r\n<div class=\"row\">\r\n    <div class=\"col-sm-9\">\r\n            <div class=\"form-group\">\r\n        		<label class=\"col-sm-3 control-label no-padding-right\" for=\"Name\"> Name </label>\r\n        		<div class=\"col-sm-9\">\r\n        			<input type=\"text\" id=\"Name\" name=\"Name\" placeholder=\"\" class=\"col-sm-8\" />\r\n        		</div>\r\n        	</div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n\r\n            <div class=\"form-group\">\r\n            	<label class=\"col-sm-3 control-label no-padding-right\" for=\"Location\"> Location </label>\r\n                <div class=\"col-sm-9\">\r\n    			    <input type=\"text\" id=\"Location\" name=\"Location\" placeholder=\"\" class=\"col-sm-6\"/>\r\n                </div>\r\n        	</div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n\r\n            <div class=\"form-group\">\r\n                <label for=\"EventDate\" class=\"col-sm-3 control-label no-padding-right\"> Date </label>\r\n            	<div class=\"col-sm-2 input-group\">\r\n                    <input type=\"text\" class=\"date-picker\" id=\"EventDate\" name=\"EventDate\" data-date-format=\"dd-mm-yyyy\"/>\r\n    				<span class=\"input-group-addon\">\r\n    					<i class=\"icon-calendar bigger-110\"></i>\r\n    				</span>\r\n                </div>\r\n            </div>\r\n        \r\n            <div class=\"space-4\"></div>\r\n\r\n            <div class=\"form-group\">\r\n                <label for=\"EventTime\" class=\"col-sm-3 control-label no-padding-right\"> Time </label>\r\n                <div class=\"col-sm-2 input-group bootstrap-timepicker\">\r\n                	<input id=\"EventTime\" name=\"EventTime\" type=\"text\" class=\"time-picker\"/>\r\n                	<span class=\"input-group-addon\">\r\n                		<i class=\"icon-time bigger-110\"></i>\r\n                	</span>\r\n                </div>                \r\n            </div>\r\n    </div>\r\n    <div class=\"col-sm-3\">\r\n		<img name=\"Picture\" class=\"img-responsive\" src=\"/UserFiles/_design/event.png\" />\r\n        <input type=\"file\" id=\"Picture\" name=\"Picture\" />\r\n    </div>\r\n</div>\r\n\r\n<div class=\"clearfix form-actions\">\r\n    <div class=\"text-right\">\r\n		<button class=\"btn btn-info\" type=\"submit\">\r\n			<i class=\"icon-ok bigger-110\"></i>\r\n			Save\r\n		</button>\r\n\r\n		&nbsp; &nbsp; &nbsp;\r\n		<button class=\"btn\" type=\"button\">\r\n			<i class=\"icon-undo bigger-110\"></i>\r\n			Cancel\r\n		</button>\r\n	</div>\r\n</div>\r\n\r\n</form>\r\nId,3,119ElementName,3,divElementId,0,Template,17,CrmEventEdit.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,0,Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(120,'CrmEventEdit.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,120ElementName,3,divElementId,0,Template,17,CrmEventEdit.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',N