act();\r\nvar id = int.Parse(Provider.Request.eId ?? \"0\");\r\nif(id>0)\r\n    e = Provider.Database.Read(typeof(Contact), id);\r\n    \r\nfunction getColor(state){\r\n    if(state==\"Joining\") return \'green !important\';\r\n    if(state==\"Invited\") return \'orange !important\';\r\n    if(state==\"Rejected\") return \'red !important\';\r\n    return \'#ABBAC3 !important\';\r\n}\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"blue\">\r\n        <i class=\"icon-user\"></i>\r\n        Contact\r\n    	<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			View contact details\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<div id=\"user-profile-1\" class=\"user-profile row\">\r\n	<div class=\"col-xs-12 col-sm-3 center\">\r\n		<div>\r\n			<span class=\"profile-picture\">\r\n				<img id=\"avatar\" class=\"img-responsive\" alt=\"Avatar\" src=\"$=(e.Picture ?? \'/UserFiles/contact.png\')$\" />\r\n			</span>\r\n\r\n			<div class=\"space-4\"></div>\r\n\r\n            <div class=\"width-80 label label-$=e.Gender==\'Male\'?\'info\':\'danger\'$ label-xlg arrowed-in arrowed-in-right\">\r\n				<div class=\"inline position-relative\">\r\n					<a href=\"#\" class=\"user-title-label dropdown-toggle\" data-toggle=\"dropdown\">\r\n						<i class=\"icon-circle light-green\"></i>\r\n						&nbsp;\r\n						<span class=\"white\">$=e.Name$</span>\r\n					</a>\r\n\r\n    				<ul class=\"align-left dropdown-menu dropdown-caret dropdown-lighter\">\r\n						<li class=\"dropdown-header\"> Process </li>\r\n\r\n						<li>\r\n							<a href=\"#\">\r\n								<i class=\"icon-pencil green\"></i>\r\n&nbsp;\r\n								<span class=\"green\" onclick=\"location.href=\'/CrmContactEdit.aspx?eId=$=e.Id$\'\">Edit</span>\r\n							</a>\r\n						</li>\r\n\r\n						<li>\r\n							<a href=\"#\">\r\n								<i class=\"icon-trash red\"></i>\r\n&nbsp;\r\n								<span class=\"red\">Archive</span>\r\n							</a>\r\n						</li>\r\n\r\n					</ul>\r\n				</div>\r\n			</div>\r\n\r\n    		<div class=\"space-4\"></div>\r\n            \r\n            <small class=\"block\">\r\n                $=e.TitleId ? \'<span class=\"orange\">Title: </span> \' + Context.GetValue(\"select Name from Definition where Id={0}\", e.TitleId) + \'<br/>\' : \'\'$\r\n                $=e.CompanyId ? \'<span class=\"orange\">Company: </span> <a href=\"/CrmCompanyView.aspx?eId=\'+e.CompanyId+\'\">\' + Context.GetValue(\"select Name from Company where Id={0}\", e.CompanyId) + \'</a>\' : \'\'$\r\n            </small>\r\n            \r\n		</div>\r\n\r\n		<div class=\"space-6\"></div>\r\n\r\n		<div class=\"profile-contact-info\">\r\n			<div class=\"profile-contact-links align-left\">\r\n				<a href=\"mailto:$=e.Email$\" class=\"btn btn-link\">\r\n					<i class=\"icon-envelope bigger-120 pink\"></i>\r\n					Send a message\r\n				</a>\r\n\r\n				<a href=\"$=e.Web$\" target=\"_blank\" class=\"btn btn-link\">\r\n					<i class=\"icon-globe bigger-125 blue\"></i>\r\n					$=e.Web ? e.Web.Replace(\"http://\",\"\").Replace(\"www.\",\"\") : \'\'$\r\n				</a>\r\n			</div>\r\n\r\n			<div class=\"space-6\"></div>\r\n\r\n			<div class=\"profile-social-links align-center\">\r\n				<a href=\"#\" class=\"tooltip-info\" title=\"\" data-original-title=\"Visit my Facebook\">\r\n					<i class=\"middle icon-facebook blue\"></i>\r\n				</a>\r\n\r\n				<a href=\"#\" class=\"tooltip-info\" title=\"\" data-original-title=\"Visit my Twitter\">\r\n					<i class=\"middle icon-twitter light-blue\"></i>\r\n				</a>\r\n\r\n				<a href=\"#\" class=\"tooltip-error\" title=\"\" data-original-title=\"Visit my Pinterest\">\r\n					<i class=\"middle icon-pinterest red\"></i>\r\n				</a>\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"hr hr12 dotted\"></div>\r\n\r\n		<div class=\"clearfix\">\r\n			<div class=\"grid2\">\r\n				<span class=\"bigger-175 blue\">$=e.ExtraField1 ?? 0 $</span><br />\r\n				Hazar World\r\n			</div>\r\n\r\n			<div class=\"grid2\">\r\n				<span class=\"bigger-175 blue\">$=e.ExtraField2 ?? 0$</span><br />\r\n				Caspian Report\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"hr hr16 dotted\"></div>\r\n	</div>\r\n\r\n	<div class=\"col-xs-12 col-sm-9\">\r\n\r\n		<div class=\"profile-user-info profile-user-info-striped\">\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Birth Date </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.BirthDate.toString(\"dd-MM-yyyy\")$\r\n				</div>\r\n			</div>\r\n\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Location </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n<i class=\"icon-map-marker light-orange bigger-110\" onclick=\"window.open(\'http://maps.google.com/?q=\'+\\$(this).parent().text(),\'_blank\')\" style=\"cursor:pointer\"></i>\r\n<span>$=e.AddressLine1$</span>\r\n$=e.Town ? \' <span>\' + e.Town + \'</span>\' : \'\'$\r\n$=e.City ? \' <span>\' + e.City + \'</span>\' : \'\'$\r\n$=e.CountryId ? \' <span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.CountryId) + \'</span>\' : \'\'$\r\n</div>\r\n			</div>\r\n\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Phone </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					<span>$=e.Phone$ $=e.InterPhone ? \'- \' + e.InterPhone : \'\'$</span>\r\n                    $=e.Phone2 ? \'<span>\' + e.Phone2 + \'</span>\' : \'\'$\r\n                    $=e.Fax ? \'<span class=\"orange\">Fax:</span> \' + e.Fax : \'\'$\r\n                    $=e.PhoneMobile ? \'<span class=\"orange\">Mobile:</span> \' + e.PhoneMobile : \'\'$\r\n				</div>\r\n			</div>\r\n\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Added </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					by $=e.InsertUser.FullName$ on $=e.InsertDate.toString(\"dd-MM-yyyy\")$\r\n				</div>\r\n			</div>\r\n\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Description </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.Description$\r\n				</div>\r\n			</div>\r\n\r\n        	<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Tags </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n    				$=e.Tags $\r\n				</div>\r\n			</div>\r\n            \r\n    		<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Interests </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n    				$=e.InterestId1 ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.InterestId1) + \'</span>\' : \'\'$\r\n    				$=e.InterestId2 ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.InterestId2) + \'</span>\' : \'\'$\r\n    				$=e.InterestId3 ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.InterestId3) + \'</span>\' : \'\'$\r\n				</div>\r\n			</div>\r\n\r\n    		<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Languages </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n    				$=e.Language1Id ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.Language1Id) + \'</span>\' : \'\'$\r\n    				$=e.Language2Id ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.Language2Id) + \'</span>\' : \'\'$\r\n    				$=e.Language3Id ? \'<span>\' + Context.GetValue(\"select Name from Definition where Id={0}\", e.Language3Id) + \'</span>\' : \'\'$\r\n				</div>\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"space-20\"></div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n        <div class=\"widget-box transparent\" id=\"recent-box\">\r\n            <div class=\"widget-header\">\r\n        		<!--h4 class=\"lighter smaller\">\r\n        			<i class=\"icon-rss orange\"></i>\r\n        			RECENT\r\n        		</h4-->\r\n        \r\n        		<div class=\"widget-toolbar no-border\">\r\n        			<ul class=\"nav nav-tabs\" id=\"recent-tab\">\r\n    \r\n        				<li>\r\n        					<a data-toggle=\"tab\" href=\"#member-tab\"><i class=\"icon-comment green\"></i> Events</a>\r\n        				</li>\r\n        \r\n        				<li class=\"active\">\r\n        					<a data-toggle=\"tab\" href=\"#comment-tab\"><i class=\"icon-comment blue\"></i> Comments</a>\r\n        				</li>\r\n        			</ul>\r\n        		</div>\r\n        	</div>\r\n        \r\n        	<div class=\"widget-body\">\r\n        		<div class=\"widget-main padding-4\">\r\n        			<div class=\"tab-content padding-8 overflow-visible\">\r\n        				<div id=\"member-tab\" class=\"tab-pane\">\r\n        					<div class=\"clearfix\">\r\n                            <h5>Upcoming :</h5>\r\n                            $\r\n                            foreach(var ec in Provider.Database.ReadList(typeof(EventContact), \"select\r\n                                            IFNULL(ec.Id, 0) as Id,\r\n                                        	e.Id as EventId,\r\n                                        	e.Name,\r\n                                            e.Picture,\r\n                                        	IFNULL(ec.State, \'None\') as State,\r\n                                        	e.EventDate\r\n                                        from\r\n                                        	Event e\r\n                                        	left join EventContact ec ON e.Id = ec.EventId AND ec.ContactId = \"+e.Id+\"\r\n                                        where\r\n                                        	e.EventDate >= date(now())\")){\r\n                            $\r\n        						<div class=\"itemdiv memberdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=ec.Picture ?? \'/Userfiles/_design/event.png\'$\" width=\"100\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"name\">\r\n        									<a href=\"/CrmEventView.aspx?eId=$=ec.EventId$\">$=ec.Name$</a>\r\n        								</div>\r\n        \r\n        								<div class=\"time\">\r\n        									<i class=\"icon-time\"></i>\r\n        									<span class=\"green\">$=ec.EventDate.ToString(\"dd-MM-yyyy\")$</span>\r\n        								</div>\r\n        \r\n        								<div>\r\n        									<span class=\"label-state label label-sm\" style=\"background-color:$=getColor(ec.State)$\">$=ec.State$</span>\r\n        \r\n        									<div class=\"inline position-relative\">\r\n        										<button class=\"btn btn-minier bigger btn-yellow btn-no-border dropdown-toggle\" data-toggle=\"dropdown\">\r\n        											<i class=\"icon-angle-down icon-only bigger-120\"></i>\r\n        										</button>\r\n        \r\n        										<ul class=\"dropdown-menu dropdown-only-icon dropdown-yellow pull-right dropdown-caret dropdown-close\">\r\n        \r\n            										<li>\r\n        												<a href=\"#\" onclick=\"updateEventContact(this,$=ec.Id$,$=ec.EventId$,$=e.Id$,\'Invited\')\" class=\"tooltip-warning\" title=\"Invited\">\r\n        													<span class=\"orange\">\r\n        														<i class=\"icon-envelope bigger-110\"></i>\r\n        													</span>\r\n        												</a>\r\n        											</li>\r\n                                                    \r\n        											<li>\r\n        												<a href=\"#\" onclick=\"updateEventContact(this,$=ec.Id$,$=ec.EventId$,$=e.Id$,\'Joining\')\" class=\"tooltip-success\" title=\"Joining\">\r\n        													<span class=\"green\">\r\n        														<i class=\"icon-ok bigger-110\"></i>\r\n        													</span>\r\n        												</a>\r\n        											</li>\r\n        \r\n        											<li>\r\n        												<a href=\"#\" onclick=\"updateEventContact(this,$=ec.Id$,$=ec.EventId$,$=e.Id$,\'Rejected\')\" class=\"tooltip-error\" title=\"Rejected\">\r\n        													<span class=\"red\">\r\n        														<i class=\"icon-remove bigger-110\"></i>\r\n        													</span>\r\n        												</a>\r\n        											</li>\r\n        										</ul>\r\n        									</div>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n                            <div class=\"clearfix\"></div>\r\n                            <hr/>\r\n                            <h5>Past :</h5>\r\n                            $\r\n                            foreach(var ec in Provider.Database.ReadList(typeof(EventContact), \"select\r\n                                            ec.Id,\r\n                                            ec.EventId,\r\n                                        	e.Name,\r\n                                            e.Picture,\r\n                                        	ec.State,\r\n                                        	e.EventDate\r\n                                        from\r\n                                        	Event e, EventContact ec\r\n                                        where\r\n                                            e.Id = ec.EventId AND \r\n                                            ec.ContactId = \"+e.Id+\" AND\r\n                                        	e.EventDate < date(now())\")){\r\n                            $\r\n        						<div class=\"itemdiv memberdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=ec.Picture ?? \'/Userfiles/_design/event.png\'$\" width=\"100\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"name\">\r\n        									<a href=\"/CrmEventView.aspx?eId=$=ec.EventId$\">$=ec.Name$</a>\r\n        								</div>\r\n        \r\n        								<div class=\"time\">\r\n        									<i class=\"icon-time\"></i>\r\n        									<span class=\"green\">$=ec.EventDate.ToString(\"dd-MM-yyyy\")$</span>\r\n        								</div>\r\n        \r\n        								<div>\r\n        									<span class=\"label-state label label-sm\" style=\"background-color:$=getColor(ec.State)$\">$=ec.State$</span>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n                            \r\n        					</div>\r\n        				</div>\r\n        \r\n        				<div id=\"comment-tab\" class=\"tab-pane active\">\r\n                			<div class=\"dialogs\" style=\"max-height:300px;overflow-y:scroll\">\r\n                            $\r\n                            foreach(var cc in Provider.Database.ReadList(typeof(EntityComment), \"select * from EntityComment where EntityName=\'Contact\' AND EntityId=\"+e.Id+\" order by Id desc\")){\r\n                            $\r\n        						<div class=\"itemdiv dialogdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=cc.InsertUser.Avatar$\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"time\">\r\n        									<i class=\"icon-clock-o\"></i>\r\n        									<span class=\"green\">$=Utility.ToAgoString(cc.InsertDate)$</span>\r\n        								</div>\r\n        \r\n        								<div class=\"name\">\r\n        									<a href=\"#\">$=cc.InsertUser.FullName$</a>\r\n        								</div>\r\n        								<div class=\"text\">$=cc.Details$</div>\r\n        \r\n        								<div class=\"tools\">\r\n        									<a href=\"#\" class=\"btn btn-minier btn-info\">\r\n        										<i class=\"icon-only icon-share\"></i>\r\n        									</a>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        					</div>\r\n        \r\n        						<div class=\"form-actions\">\r\n        							<div class=\"input-group\">\r\n        								<input placeholder=\"Type your comment here...\" type=\"text\" class=\"form-control\" id=\"message\" name=\"message\" />\r\n        								<span class=\"input-group-btn\">\r\n        									<button class=\"btn btn-sm btn-info no-radius\" type=\"button\" onclick=\"saveEntity(\'EntityComment\', {Details:\\$(\'#message\').val(), EntityName:\'Contact\', EntityId:$=e.Id$}, function(){refreshModule(\'#StaticHtml_123\');});\">\r\n        										<i class=\"icon-share\"></i>\r\n        										Send\r\n        									</button>\r\n        								</span>\r\n        							</div>\r\n        						</div>\r\n\r\n                        </div>\r\n        			</div>\r\n        		</div><!-- /widget-main -->\r\n        	</div><!-- /widget-body -->\r\n        </div><!-- /widget-box -->\r\n\r\n\r\n\r\n	</div>\r\n</div>\r\nId,3,123Template,19,CrmContactView.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlDetails,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0ParentModuleId,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(124,'CrmContactView.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,124ElementName,3,divElementId,0,Template,19,CrmContactView.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(125,'CrmContactView.aspx','sidebar',0,'RegionRep