mportant\';\r\n    return \'#ABBAC3 !important\';\r\n}\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"pink\">\r\n        <i class=\"icon-film\"></i>\r\n        Event\r\n    	<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			View event details\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<div id=\"user-profile-1\" class=\"user-profile row\">\r\n	<div class=\"col-xs-12 col-sm-3 center\">\r\n		<div>\r\n			<span class=\"profile-picture\">\r\n				<img id=\"avatar\" class=\"img-responsive\" alt=\"Avatar\" src=\"$=e.Picture$\" />\r\n			</span>\r\n\r\n			<div class=\"space-4\"></div>\r\n\r\n            <div>\r\n				<div class=\"inline position-relative\">\r\n					<a href=\"#\" class=\"user-title-label dropdown-toggle\" data-toggle=\"dropdown\">\r\n						<i class=\"icon-circle $=e.EventDate>=DateTime.Now.Date ? \'light-green\' : \'red\'$\"></i>\r\n						&nbsp;\r\n						<span>$=e.Name$</span>\r\n					</a>\r\n\r\n    				<ul class=\"align-left dropdown-menu dropdown-caret dropdown-lighter\">\r\n						<li class=\"dropdown-header\"> Process </li>\r\n\r\n						<li>\r\n							<a href=\"/CrmEventEdit.aspx?eId=$=e.Id$\">\r\n								<i class=\"icon-pencil green\"></i>&nbsp;\r\n								<span class=\"green\">Edit</span>\r\n							</a>\r\n						</li>\r\n\r\n						<li>\r\n							<a href=\"#\">\r\n								<i class=\"icon-trash red\"></i>&nbsp;\r\n								<span class=\"red\">Archive</span>\r\n							</a>\r\n						</li>\r\n\r\n					</ul>\r\n				</div>\r\n			</div>\r\n\r\n    		<div class=\"space-4\"></div>\r\n            \r\n            <small class=\"block\">\r\n                <span class=\"orange\">on </span> $=e.EventDate.ToString(\"dd-MM-yyyy\") + \" \" + e.EventTime$ <br/>\r\n                <span class=\"orange\">in </span> $=e.Location$\r\n            </small>\r\n            \r\n		</div>\r\n\r\n	</div>\r\n\r\n	<div class=\"col-xs-12 col-sm-9\">\r\n\r\n        <div class=\"widget-box transparent\" id=\"recent-box\">\r\n            <div class=\"widget-header\">\r\n        \r\n        		<div class=\"widget-toolbar no-border\">\r\n        			<ul class=\"nav nav-tabs\" id=\"recent-tab\">\r\n        				<li class=\"active\">\r\n        					<a data-toggle=\"tab\" href=\"#Joining\"><i class=\"icon-ok green\"></i> Joining (<span id=\"JoiningCount\">$=Provider.Database.GetValue(\"select count(*) from EventContact where EventId=\"+e.Id+\" AND State=\'Joining\'\")$</span>)</a>\r\n        				</li>\r\n        \r\n        				<li>\r\n        					<a data-toggle=\"tab\" href=\"#Invited\"><i class=\"icon-envelope orange\"></i> Invited (<span id=\"InvitedCount\">$=Provider.Database.GetValue(\"select count(*) from EventContact where EventId=\"+e.Id+\" AND State=\'Invited\'\")$</span>)</a>\r\n        				</li>\r\n        \r\n        				<li>\r\n        					<a data-toggle=\"tab\" href=\"#Rejected\"><i class=\"icon-remove red\"></i> Rejected (<span id=\"RejectedCount\">$=Provider.Database.GetValue(\"select count(*) from EventContact where EventId=\"+e.Id+\" AND State=\'Rejected\'\")$</span>)</a>\r\n        				</li>\r\n        			</ul>\r\n        		</div>\r\n        	</div>\r\n        \r\n        	<div class=\"widget-body\">\r\n        		<div class=\"widget-main padding-4\">\r\n        			<div class=\"tab-content padding-8 overflow-visible\">\r\n\r\n            			<div id=\"Joining\" class=\"tab-pane active\">\r\n        					<div class=\"clearfix\">\r\n                            $\r\n                            foreach(var ec in Provider.Database.ReadList(typeof(EventContact), \"select\r\n                                            ec.Id,\r\n                                        	ec.ContactId,\r\n                                        	c.Name,\r\n                                        	ec.State\r\n                                        from\r\n                                        	EventContact ec, Contact c\r\n                                        where\r\n                                            ec.State = \'Joining\' AND\r\n 