fix\">\r\n                            $\r\n                            foreach(var ec in Provider.Database.ReadList(typeof(Contact), \"select\r\n                                            Id,\r\n                                        	Name,\r\n                                            Picture,\r\n                                            Phone,\r\n                                            Email\r\n                                        from\r\n                                        	Contact\r\n                                        where\r\n                                        	CompanyId = \"+e.Id)){\r\n                            $\r\n        						<div class=\"itemdiv memberdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=ec.Picture ?? \'/UserFiles/contact.png\'$\" height=\"60\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n            							<div class=\"name\">\r\n        									<a href=\"/CrmContactView.aspx?eId=$=ec.Id$\">$=ec.Name$</a>\r\n        								</div>\r\n            							<div class=\"detail\">\r\n        									$=ec.Phone$\r\n        								</div>\r\n            							<div class=\"detail\">\r\n        									$=ec.Email$\r\n        								</div>\r\n        \r\n        \r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        					</div>\r\n        				</div>\r\n        \r\n        				<div id=\"comment-tab\" class=\"tab-pane\">\r\n            				<div class=\"dialogs\" style=\"max-height:300px;overflow-y:scroll\">\r\n                            $\r\n                            foreach(var cc in Provider.Database.ReadList(typeof(EntityComment), \"select * from EntityComment where EntityName=\'Company\' AND EntityId=\"+e.Id+\" order by Id desc\")){\r\n                            $\r\n        						<div class=\"itemdiv dialogdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=cc.InsertUser.Avatar$\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"time\">\r\n        									<i class=\"icon-clock-o\"></i>\r\n        									<span class=\"green\">$=Utility.ToAgoString(cc.InsertDate)$</span>\r\n        								</div>\r\n        \r\n        								<div class=\"name\">\r\n        									<a href=\"#\">$=cc.InsertUser.FullName$</a>\r\n        								</div>\r\n        								<div class=\"text\">$=cc.Details$</div>\r\n        \r\n        								<div class=\"tools\">\r\n        									<a href=\"#\" class=\"btn btn-minier btn-info\">\r\n        										<i class=\"icon-only icon-share\"></i>\r\n        									</a>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        					</div>\r\n        \r\n\r\n        						<div class=\"form-actions\">\r\n        							<div class=\"input-group\">\r\n        								<input placeholder=\"Type your comment here...\" type=\"text\" class=\"form-control\" id=\"message\" name=\"message\" />\r\n        								<span class=\"input-group-btn\">\r\n        									<button class=\"btn btn-sm btn-info no-radius\" type=\"button\" onclick=\"saveEntity(\'EntityComment\', {Details:\\$(\'#message\').val(), EntityName:\'Company\', EntityId:$=e.Id$}, function(){refreshModule(\'#StaticHtml_123\');});\">\r\n        										<i class=\"icon-share\"></i>\r\n        										Send\r\n        									</button>\r\n        								</span>\r\n        							</div>\r\n        						</div>\r\n\r\n        				</div>\r\n        			</div>\r\n        		</div><!-- /widget-main -->\r\n        	</div><!-- /widget-body -->\r\n        </div><!-- /widget-box -->\r\n\r\n\r\n\r\n	</div>\r\n</div>\r\nId,3,132ElementName,3,divElementId,0,Template,19,CrmCompanyView.aspxRegion,10,contentDivOrderNo,1,0Name,10,Stati