 dt = Provider.Database.GetDataTable(sql);\r\nforeach(var dr in dt.Rows)\r\n    dr.Timing = Utility.ToStringSpan(dr.StartDate, dr.DueDate, \'MMMM\');\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"orange\">\r\n        <i class=\"icon-briefcase\"></i>\r\n		Projects\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			to keep us busy\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<h4 class=\"header smaller lighter red\" style=\"margin-left:10px\">Filter</h4>\r\n<form method=\"post\" action=\"IssueProjects.aspx\">\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"ManagerId\" name=\"ManagerId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Manager</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User where Id<>2 order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.ManagerId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    \r\n    <div class=\"col-sm-2\">\r\n        <button type=\"submit\" class=\"btn btn-xs btn-success\">\r\n			Filter\r\n			<i class=\"icon-arrow-right icon-on-right bigger-110\"></i>\r\n		</button>\r\n    </div>\r\n</form>\r\n<br/><br/>\r\n\r\n<div class=\"table-responsive\">\r\n    <div id=\"table-storage_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n        <table id=\"table-entity\" class=\"table table-striped table-bordered table-hover dataTable\" aria-describedby=\"table-storage_info\">\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \\$(function(){\r\n        var dt = $=Utility.ToJSON(dt)$;\r\n        bindTable({\r\n              list: dt.rows,\r\n              tableId: \"#table-entity\",\r\n              columns: [\r\n                  {\r\n                      \"mData\": \"Name\",\r\n                      \"sTitle\": \"Project Name\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a href=\"/IssueProjectView.aspx?eId=\'+full.Id+\'\">\'+full.Name+\'</a>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Completed\",\r\n                      \"sTitle\": \"Tasks\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<div class=\"progress\" data-percent=\"\'+full.Completed + \' / \' + full.Total+\'\"><div class=\"progress-bar\" style=\"width:\'+(full.Completed/full.Total*100)+\'%;\"></div></div>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Timing\",\r\n                      \"sTitle\": \"Timing\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return full.Timing;\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": null,\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a class=\"green\" href=\"/IssueProjectEdit.aspx?eId=\'+full.Id+\'\"><i class=\"icon-pencil bigger-130\"></i></a> &nbsp; \' +\r\n                                  \'<a class=\"red\" href=\"#\"><i class=\"icon-trash bigger-130\" ></i></a>\';\r\n                      }\r\n                  }\r\n              ]\r\n          });\r\n    });\r\n    \r\n</script>\r\n\r\n<div class=\"clearfix form-actions\">\r\n	<button class=\"btn btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/IssueProjectEdit.aspx\';\">\r\n		<i class=\"icon-add bigger-110\"></i>\r\n		Add New\r\n	</button>\r\n</div>ParentModuleId,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(143,'IssueProjects.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,143ElementName,3,divElementId,0,Template,17,IssueProject.aspxRegion,6,navbarOrderNo,1,0Name,