11,breadcrumbsId,3,149ElementName,3,divElementId,0,Template,21,IssueProjectEdit.aspxRegion,11,breadcrumbsOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(150,'IssueProjectEdit.aspx','contentDiv',0,'Form','','Cinar.CMS.Serialization\nEntityName,7,ProjectInnerHtml,4008,$\r\nvar e = new Project();\r\nvar id = int.Parse(Provider.Request.eId ?? \"0\");\r\nif(id>0)\r\n    e = Provider.Database.Read(typeof(Project), id);\r\n\r\nif(Provider.Request.cmdName){\r\n    if(Provider.Request.cmdName==\"save\")\r\n    {\r\n        e.SetFieldsByPostData(Provider.Request.Form);\r\n        e.Save();\r\n        Provider.Response.Redirect(\"/IssueProjectView.aspx?eId=\"+e.Id);\r\n    }\r\n}\r\n$\r\n<script>\r\n    \\$(function(){\r\n        loadForm(\'#form\', $=Utility.ToJSON(e)$, \'$=Provider.Request.mode$\');\r\n    });\r\n</script>\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"orange\">\r\n        <i class=\"icon-briefcase\"></i>\r\n        Project\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n    		$=e.Id>0 ? \'Edit details\' : \'Add new\'$\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<form id=\"form\" method=\"post\" action=\"$=Provider.Request.RawUrl$\" enctype=\"multipart/form-data\" class=\"form-horizontal\" role=\"form\" autocomplete=\"off\">\r\n<input type=\"hidden\" name=\"cmdName\" value=\"save\"/>\r\n<input type=\"hidden\" name=\"Id\" value=\"$=e.Id$\"/>\r\n<div class=\"row\">\r\n    <div class=\"col-sm-9\">\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"Name\" class=\"col-sm-4 control-label no-padding-right\"> Name </label>\r\n        	<div class=\"col-sm-8\">\r\n                <input type=\"text\" name=\"Name\" id=\"Name\" placeholder=\"\" class=\"col-sm-6 form-control\"/>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"Description\" class=\"col-sm-4 control-label no-padding-right\"> Description </label>\r\n    		<div class=\"col-sm-8\">\r\n                <textarea name=\"Description\" id=\"Description\" rows=\"3\" class=\"col-sm-8 form-control\"></textarea>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"StartDate\" class=\"col-sm-4 control-label no-padding-right\"> Start Date </label>\r\n    		<div class=\"col-sm-4 col-xs-6 input-group\">\r\n                <input class=\"date-picker form-control\" type=\"text\" name=\"StartDate\" id=\"StartDate\" data-date-format=\"dd-mm-yyyy\"/><span class=\"input-group-addon\"><i class=\"icon-calendar bigger-110\"></i></span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"DueDate\" class=\"col-sm-4 control-label no-padding-right\"> Due Date </label>\r\n    		<div class=\"col-sm-4 col-xs-6 input-group\">\r\n                <input class=\"date-picker form-control\" type=\"text\" name=\"DueDate\" id=\"DueDate\" data-date-format=\"dd-mm-yyyy\"/><span class=\"input-group-addon\"><i class=\"icon-calendar bigger-110\"></i></span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"ManagerId\" class=\"col-sm-4 control-label no-padding-right\"> Manager </label>\r\n        	<div class=\"col-sm-5 input-group\">\r\n                <select id=\"ManagerId\" name=\"ManagerId\" class=\"form-control\">\r\n                    $\r\n                    foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User order by Name\").Rows)\r\n                        echo(\'<option value=\"\'+dr.Id+\'\"\'+(e.ManagerId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n                    $\r\n                </select>\r\n                <span class=\"input-group-addon\" onclick=\"\\$(\'#ManagerId\').val($=Provider.User.Id$)\">me</span>\r\n            </div>\r\n        </div>\r\n\r\n    </div>\r\n    <div class=\"col-sm-3\">\r\n    	<img name=\"Picture\" class=\"img-responsive\" src=\"/UserFiles/contact.png\" />\r\n        <input type=\"file\" id=\"Picture\" name=\"Picture\" /><br/>\r\n        $ if(e.Id>0){ $\r\n        <em><i class=\"icon-ok green\"></i>Added by $=e.InsertUser.FullName$ on $=e.InsertDate.ToString(\"dd-MM-yyyy\")$</em>\r\n        $ } $\r\n    </div>\r\n</div>\r\n\r\n<div class=\"clearfix form-actions\">\r\n	<div class=\"text-right\">\r\n		<button class=\"btn btn-info\" type=\"submit\">\r\n			<i class=\"icon-ok bigger-110\"></i>\r\n			Save\r\n		</button>\r\n\r\n		&nbsp; &nbsp; &nbsp;\r\n		<button class=\"btn\" type=\"button\" onclick=\"history.go(-1)\">\r\n			<i class=\"icon-undo bigger-110\"></i>\r\n			Cancel\r\n		</button>\r\n	</div>\r\n</div>\r\n\r\n</form>\r\nId,3,150ElementName,3,divElementId,0,CSSClass,0,CSS,0,TopHtml,0,BottomHtml,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Template,21,IssueProjectEdit.aspxRegion,10,contentDivOrderNo,1,0Name,4,FormParentModuleId,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(151,'IssueProjectView.aspx','contentDiv',0,'StaticHtml','.itemdiv.memberdiv {\r\n    width: 200px;\r\n    border-bottom: none;\r\n}\r\n\r\n.itemdiv.memberdiv > .user > img {\r\n    border-radius:0%;\r\n    max-width: 100px;\r\n}\r\n.itemdiv.memberdiv > .body {\r\n    margin-left: 60px;\r\n}\r\n\r\n.itemdiv.memberdiv > .body > .time {\r\n    margin-bottom: 8px;\r\n}\r\n\r\n.profile-picture {\r\n    max-width: 65% !important;\r\n}\r\n#tasks li {\r\n    line-height: 26px;\r\n}\r\nli[class*=\"item-\"] {\r\n    border-left-width: 5px !important;\r\n}','Cinar.CMS.Serialization\nId,3,151ElementName,3,divElementId,0,Template,21,IssueProjectView.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,442,.itemdiv.memberdiv {\r\n    width: 200px;\r\n    border-bottom: none;\r\n}\r\n\r\n.itemdiv.memberdiv > .user > img {\r\n    border-radius:0%;\r\n    max-width: 100px;\r\n}\r\n.itemdiv.memberdiv > .body {\r\n    margin-left: 60px;\r\n}\r\n\r\n.itemdiv.memberdiv > .body > .time {\r\n    margin-bottom: 8px;\r\n}\r\n\r\n.profile-picture {\r\n    max-width: 65% !important;\r\n}\r\n#tasks li {\r\n    line-height: 26px;\r\n}\r\nli[class*=\"item-\"] {\r\n    border-left-width: 5px !important;\r\n}Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0CSSClass,0,TopHtml,0,BottomHtml,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0InnerHtml,12527,$\r\nvar e = new Project();\r\nvar id = int.Parse(Provider.Request.eId ?? \"0\");\r\nif(id>0)\r\n    e = Provider.Database.Read(typeof(Project), id);\r\n$\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"orange\">\r\n        <i class=\"icon-briefcase\"></i>\r\n        Project\r\n        <small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			View project details\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<div id=\"user-profile-1\" class=\"user-profile row\">\r\n	<div class=\"col-xs-12 col-sm-3 center\">\r\n		<div>\r\n			<span class=\"profile-picture\">\r\n				<img id=\"avatar\" class=\"img-responsive\" alt=\"Avatar\" src=\"$=(e.Picture : \'/UserFiles/project.png\')$\" />\r\n			</span>\r\n\r\n			<div class=\"space-4\"></div>\r\n\r\n            <div>\r\n				<div class=\"inline position-relative\">\r\n					<a href=\"#\" class=\"user-title-label dropdown-toggle\" data-toggle=\"dropdown\">\r\n						<i class=\"icon-circle light-$=e.DueDate>DateTime.Now ? \'green\':\'red\'$\"></i>\r\n						&nbsp;\r\n						<span>$=e.Name$</span>\r\n					</a>\r\n\r\n    				<ul class=\"align-left dropdown-menu dropdown-caret dropdown-lighter\">\r\n						<li class=\"dropdown-header\"> Process </li>\r\n\r\n						<li>\r\n							<a href=\"/IssueProjectEdit.aspx?eId=$=e.Id$\">\r\n								<i class=\"icon-pencil green\"></i>&nbsp;\r\n								<span class=\"green\">Edit</span>\r\n							</a>\r\n						</li>\r\n\r\n						<li>\r\n							<a href=\"#\">\r\n								<i class=\"icon-trash red\"></i>&nbsp;\r\n								<span class=\"red\">Archive</span>\r\n							</a>\r\n						</li>\r\n\r\n					</ul>\r\n				</div>\r\n			</div>\r\n            \r\n		</div>\r\n\r\n\r\n		<div class=\"hr hr12 dotted\"></div>\r\n\r\n		<div class=\"clearfix\">\r\n			<div class=\"grid2\">\r\n				<span class=\"bigger-175 blue\">$=e.GetTasks().Count $</span><br />\r\n				Tasks\r\n			</div>\r\n\r\n			<div class=\"grid2\">\r\n				<span class=\"bigger-175 blue\">$=Context.GetValue(\"select count(distinct AssignedToId) from Task where ProjectId={0}\", e.Id) $</span><br />\r\n				Team Members\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"hr hr16 dotted\"></div>\r\n	</div>\r\n\r\n	<div class=\"col-xs-12 col-sm-9\">\r\n\r\n		<div class=\"profile-user-info profile-user-info-striped\">\r\n\r\n    		<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Name </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					<b>$=e.Name$</b>\r\n				</div>\r\n			</div>\r\n\r\n        	<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Description </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.Description$\r\n				</div>\r\n			</div>\r\n\r\n        	<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Prj. Manager </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.Manager.FullName$\r\n				</div>\r\n			</div>\r\n\r\n            <div class=\"profile-info-row\">\r\n    			<div class=\"profile-info-name\"> Start Date </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.StartDate.toString(\"dd-MM-yyyy\")$\r\n				</div>\r\n			</div>\r\n\r\n            <div class=\"profile-info-row\">\r\n    			<div class=\"profile-info-name\"> Due Date </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					$=e.DueDate.toString(\"dd-MM-yyyy\")$\r\n				</div>\r\n			</div>\r\n\r\n			<div class=\"profile-info-row\">\r\n				<div class=\"profile-info-name\"> Added </div>\r\n\r\n				<div class=\"profile-info-value\">\r\n					by $=e.InsertUser.FullName$ on $=e.InsertDate.toString(\"dd-MM-yyyy\")$\r\n				</div>\r\n			</div>\r\n		</div>\r\n\r\n		<div class=\"space-20\"></div>\r\n\r\n\r\n\r\n        <div class=\"widget-box transparent\" id=\"recent-box\">\r\n            <div class=\"widget-header\">\r\n    \r\n        		<div class=\"widget-toolbar no-border\">\r\n        			<ul class=\"nav nav-tabs\" id=\"recent-tab\">\r\n        				<li class=\"active\">\r\n        					<a data-toggle=\"tab\" href=\"#task-tab\"><i class=\"icon-check red\"></i> Tasks</a>\r\n        				</li>\r\n        \r\n        				<li>\r\n        					<a data-toggle=\"tab\" href=\"#member-tab\"><i class=\"icon-comment green\"></i> Team Members</a>\r\n        				</li>\r\n        \r\n        				<li>\r\n        					<a data-toggle=\"tab\" href=\"#comment-tab\"><i class=\"icon-comment blue\"></i> Comments</a>\r\n        				</li>\r\n        			</ul>\r\n        		</div>\r\n        	</div>\r\n        \r\n        	<div class=\"widget-body\">\r\n        		<div class=\"widget-main padding-4\">\r\n        			<div class=\"tab-content padding-8 overflow-visible\">\r\n        				<div id=\"task-tab\" class=\"tab-pane active\">\r\n                			<div class=\"dialogs\" style=\"max-height:300px;overflow-y:scroll\">\r\n        					<ul id=\"tasks\" class=\"item-list\" style=\"width:auto\">\r\n                                $\r\n                                function getColor(per, status){\r\n                                    if(status==\'Completed\')\r\n                                        return \'green\';\r\n                                    if(status==\'Rejected\')\r\n                                        return \'red\';\r\n                                    if(status==\'Accepted\')\r\n                                        return \'orange\';\r\n                                    return \'blue\';\r\n                                }\r\n                                foreach(var t in Provider.Database.ReadList(typeof(Task), \"select\r\n                                                Id,\r\n                                                AssignedToId,\r\n                                                Name,\r\n                                                Status,\r\n                                                case when Status=\'Accepted\' then 1\r\n                                                     when Status=\'New\' then 2\r\n                                                     when Status=\'Rejected\' then 3\r\n                                                     else 4 end as OrderNo,\r\n                                                round((now()-StartDate)/(DueDate-StartDate)*100) as Percent\r\n                                            from\r\n                                            	Task\r\n                                            where ProjectId=\"+e.Id+\" order by 5, Id desc\")){\r\n                                $\r\n        						<li class=\"item-$=getColor(t.Percent, t.Status)$ clearfix\">\r\n        							<label class=\"inline\">\r\n        								<span class=\"lbl\"><img src=\"$=t.AssignedTo.Avatar ?? \'/UserFiles/contact.png\'$\" height=\"32\"/> &nbsp; <a href=\"/IssueTAskView.aspx?eId=$=t.Id$\">$=Utility.StrCrop(t.Name, 70)$</a></span>\r\n        							</label>\r\n                                    $ if(t.Status==\'Accepted\' || t.Status==\'New\'){ $\r\n        							<div class=\"pull-right easy-pie-chart percentage\" data-size=\"30\" data-color=\"#ECCB71\" data-percent=\"$=t.Percent>100 ? 100 : (t.Percent<0 ? 0 : t.Percent)$\">\r\n        								<span class=\"percent\">$=t.Percent>100 ? \'!\' : ((t.Percent<0 ? 0 : t.Percent)+\'%\')$</span>\r\n        							</div>\r\n                                    $ } $\r\n        						</li>\r\n                                $\r\n                                }\r\n                                $\r\n        					</ul>\r\n            				</div>\r\n        \r\n\r\n        						<div class=\"form-actions\">\r\n        							<div class=\"input-group\">\r\n        								<input placeholder=\"Type new task here...\" type=\"text\" class=\"col-sm-5\" id=\"message\" name=\"message\" />\r\n                                        <select id=\"AssignedToId\" name=\"AssignedToId\" class=\"col-sm-4\">\r\n                                            <option value=\"0\">Assigned To</option>\r\n                                            $\r\n                                            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User order by Name\").Rows)\r\n                                                echo(\'<option value=\"\'+dr.Id+\'\"\'+(e.AssignedToId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n                                            $\r\n                                        </select>\r\n                                        <input class=\"date-picker col-sm-3\" type=\"text\" name=\"DueDate\" id=\"DueDate\" data-date-format=\"dd-mm-yyyy\" placeholder=\"Due Date\"/>\r\n                                        <span class=\"input-group-btn\">\r\n        									<button class=\"btn btn-sm btn-info no-radius\" type=\"button\" onclick=\"saveEntity(\'Task\', {Name:\\$(\'#message\').val(), ProjectId:$=e.Id$, AssignedToId:\\$(\'#AssignedToId\').val(), DueDate:\\$(\'#DueDate\').val()}, function(){location.reload();});\">\r\n        										<i class=\"icon-share\"></i>\r\n        										Send\r\n        									</button>\r\n        								</span>\r\n        							</div>\r\n        						</div>\r\n\r\n        				</div>\r\n        \r\n        				<div id=\"member-tab\" class=\"tab-pane\">\r\n                			<div class=\"dialogs\" style=\"max-height:300px;overflow-y:scroll\">\r\n                            $\r\n                            foreach(var ec in Provider.Database.ReadList(typeof(User), \"select\r\n                                            u.Id,\r\n                                        	u.Name,\r\n                                            u.Avatar,\r\n                                            min(t.InsertDate) as InsertDate\r\n                                        from\r\n                                        	Task t\r\n                                        	left join User u ON u.Id = t.AssignedToId\r\n                                        where\r\n                                            t.ProjectId = \"+e.Id+\"\r\n                                        group by 1,2,3\r\n                                        order by 4\")){\r\n                            $\r\n        						<div class=\"itemdiv memberdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=ec.Avatar$\" width=\"48\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"name\">\r\n        									<a href=\"/IssueTask.aspx?UserId=$=ec.Id$&ProjectId=$=e.Id$\">$=ec.Name$</a>\r\n        								</div>\r\n        \r\n        								<div class=\"time\">\r\n        									<i class=\"icon-time\"></i>\r\n        									<span class=\"green\">$=ec.InsertDate.ToString(\"dd-MM-yyyy\")$</span>\r\n        								</div>\r\n        \r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        					</div>\r\n            				<form>\r\n        						<div class=\"form-actions\">\r\n        							<div class=\"input-group\">\r\n        								<input style=\"visibility:hidden\" type=\"text\" class=\"form-control\" />\r\n        							</div>\r\n        						</div>\r\n        					</form>\r\n                        </div>\r\n        \r\n        				<div id=\"comment-tab\" class=\"tab-pane\">\r\n            				<div class=\"dialogs\" style=\"max-height:300px;overflow-y:scroll\">\r\n                            $\r\n                            foreach(var cc in Provider.Database.ReadList(typeof(EntityComment), \"select * from EntityComment where EntityName=\'Project\' AND EntityId=\"+e.Id+\" order by Id desc\")){\r\n                            $\r\n        						<div class=\"itemdiv dialogdiv\">\r\n        							<div class=\"user\">\r\n        								<img src=\"$=cc.InsertUser.Avatar$\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"time\">\r\n        									<i class=\"icon-clock-o\"></i>\r\n        									<span class=\"green\">$=Utility.ToAgoString(cc.InsertDate)$</span>\r\n        								</div>\r\n        \r\n        								<div class=\"name\">\r\n        									<a href=\"#\">$=cc.InsertUser.FullName$</a>\r\n        								</div>\r\n        								<div class=\"text\">$=cc.Details$</div>\r\n        \r\n        								<div class=\"tools\">\r\n        									<a href=\"#\" class=\"btn btn-minier btn-info\">\r\n        										<i class=\"icon-only icon-share\"></i>\r\n        									</a>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        					</div>\r\n        \r\n\r\n        						<div class=\"form-actions\">\r\n        							<div class=\"input-group\">\r\n        								<input placeholder=\"Type your comment here...\" type=\"text\" class=\"form-control\" id=\"message\" name=\"message\" />\r\n        								<span class=\"input-group-btn\">\r\n        									<button class=\"btn btn-sm btn-info no-radius\" type=\"button\" onclick=\"saveEntity(\'EntityComment\', {Details:\\$(\'#message\').val(), EntityName:\'Project\', EntityId:$=e.Id$}, function(){refreshModule(\'#StaticHtml_123\');});\">\r\n        										<i class=\"icon-share\"></i>\r\n        										Send\r\n        									</button>\r\n        								</span>\r\n        							</div>\r\n        						</div>\r\n\r\n        				</div>\r\n        			</div>\r\n        		</div><!-- /widget-main -->\r\n        	</div><!-- /widget-body -->\r\n        </div><!-- /widget-box -->\r\n\r\n\r\n\r\n	</div>\r\n</div>\r\nParentModuleId,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(152,'IssueProjectView.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,152ElementName,3,divElementId,0,Template,21,IssueProjectView.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(153,'IssueProjectView.aspx','sidebar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,7,sidebarId,3,153ElementName,3,divElementId,0,Template,21,IssueProjectView.aspxRegion,7,sidebarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(154,'IssueProjectView.aspx','breadcrumbs',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,11,breadcrumbsId,3,154ElementName,3,divElementId,0,Template,21,IssueProjectView.aspxRegion,11,breadcrumbsOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(155,'IssueTasks.aspx','contentDiv',0,'StaticHtml','.bigTitle {\r\n    font-size:16px;\r\n}\r\n\r\nimg.rowAvatar {\r\n    width: 36px;\r\n    float: left;\r\n    margin-right: 7px;\r\n    border-radius: 20%;\r\n    border: 1px solid #547ea8;\r\n}\r\ndiv.status {\r\n    display: inline-block;\r\n    color: #FFF;\r\n    padding: 2px 8px;\r\n}','Cinar.CMS.Serialization\nInnerHtml,6642,$\r\nvar sql = \"select \r\n                t.*,\r\n                \'\' as Timing,\r\n                round((now()-t.StartDate)/(t.DueDate-t.StartDate)*100) as Percent,\r\n                u.Avatar,\r\n                p.Name as ProjectName\r\n            from\r\n                Task t\r\n                left join Project p ON p.Id = t.ProjectId\r\n                left join User u ON u.Id = t.AssignedToId\r\n            where\r\n                1=1\";\r\n\r\nif(Provider.Request.AssignedToId>0)\r\n    sql += \" AND t.AssignedToId = \" + Int32.Parse(Provider.Request.AssignedToId);\r\nif(Provider.Request.ReportedById>0)\r\n    sql += \" AND t.ReportedById = \" + Int32.Parse(Provider.Request.ReportedById);\r\nif(Provider.Request.ProjectId>0)\r\n    sql += \" AND t.ProjectId = \" + Int32.Parse(Provider.Request.ProjectId);\r\nif(Provider.Request.Status)\r\n    sql += \" AND t.Status = \'\" + Provider.Request.Status + \"\'\";\r\nif(Provider.Request.Priority)\r\n    sql += \" AND t.Priority = \'\" + Provider.Request.Priority + \"\'\";\r\n    \r\nsql += \" limit 100\";\r\n\r\nvar dt = Provider.Database.GetDataTable(sql);\r\nforeach(var dr in dt.Rows)\r\n    dr.Timing = Utility.ToStringSpan(dr.StartDate, dr.DueDate, \'MMMM\');\r\n$\r\n\r\n<div class=\"page-header\">\r\n	<h1 class=\"red\">\r\n        <i class=\"icon-check\"></i>\r\n		Tasks\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			to remember what to do next\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<h4 class=\"header smaller lighter red\" style=\"margin-left:10px\">Filter</h4>\r\n<form method=\"post\" action=\"IssueTasks.aspx\">\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"ProjectId\" name=\"ProjectId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Project</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Project order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.ProjectId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"AssignedToId\" name=\"AssignedToId\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Assigned To</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User where Id<>2 order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.AssignedToId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"ReportedById\" name=\"ReportedById\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"0\">Reported By</option>\r\n            $\r\n            foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User where Id<>2 order by Name\").Rows)\r\n                echo(\'<option value=\"\'+dr.Id+\'\"\'+(Provider.Request.ReportedById==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"Priority\" name=\"Priority\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"\">Priority</option>\r\n            $\r\n            foreach(var dr in Enum.GetNames(typeof(TicketPriority)))\r\n                echo(\'<option value=\"\'+dr+\'\"\'+(Provider.Request.Priority==dr ? \' selected\':\'\')+\'>\'+dr+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    <div class=\"col-sm-2\">\r\n        <select id=\"Status\" name=\"Status\" class=\"width-100 withPlaceHolder\">\r\n            <option value=\"\">Status</option>\r\n            $\r\n            foreach(var dr in Enum.GetNames(typeof(TicketStatus)))\r\n                echo(\'<option value=\"\'+dr+\'\"\'+(Provider.Request.Status==dr ? \' selected\':\'\')+\'>\'+dr+\'</option>\\r\\n\');\r\n            $\r\n        </select>\r\n    </div>\r\n    \r\n    <div class=\"col-sm-2\">\r\n        <button type=\"submit\" class=\"btn btn-xs btn-success\">\r\n			Filter\r\n			<i class=\"icon-arrow-right icon-on-right bigger-110\"></i>\r\n		</button>\r\n    </div>\r\n</form>\r\n<br/><br/>\r\n\r\n<div class=\"table-responsive\">\r\n    <div id=\"table-storage_wrapper\" class=\"dataTables_wrapper\" role=\"grid\">\r\n        <table id=\"table-entity\" class=\"table table-striped table-bordered table-hover dataTable\" aria-describedby=\"table-storage_info\">\r\n        </table>\r\n    </div>\r\n</div>\r\n\r\n<script>\r\n    \\$(function(){\r\n        var dt = $=Utility.ToJSON(dt)$;\r\n        bindTable({\r\n              list: dt.rows,\r\n              tableId: \"#table-entity\",\r\n              columns: [\r\n                  {\r\n                      \"mData\": \"Name\",\r\n                      \"sTitle\": \"Task & Assignee\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<img src=\"\'+full.Avatar+\'\" class=\"rowAvatar\"/>\' + \r\n                                \'<small><span class=\"orange\">Project:</span> <a href=\"/IssueProjectView.aspx?eId=\'+full.ProjectId+\'\">\'+full.ProjectName+\'</a></small><br/>\' +\r\n                                \'<a class=\"bigTitle\" href=\"/IssueTaskView.aspx?eId=\'+full.Id+\'\">\'+full.Name+\'</a>\' + \r\n                                (full.Priority==\'High\' ? \' <i class=\"icon-flag red\"></i>\' : \'\') + \r\n                                (full.Priority==\'Low\' ? \' <i class=\"icon-flag light-blue\"></i>\' : \'\');\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Status\",\r\n                      \"sTitle\": \"Status\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<div class=\"status \'+full.Status+\'\">\' + full.Status + \'</div>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": \"Percent\",\r\n                      \"sTitle\": \"Timing\",\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<div class=\"progress\" data-percent=\"\'+full.Timing+\'\"><div class=\"progress-bar\" style=\"width:\'+(full.Percent)+\'%;\"></div></div>\';\r\n                      }\r\n                  },\r\n                  {\r\n                      \"mData\": null,\r\n                      \"mRender\": function (data, type, full) {\r\n                          return \'<a class=\"green\" href=\"/IssueTaskEdit.aspx?eId=\'+full.Id+\'\"><i class=\"icon-pencil bigger-130\"></i></a> &nbsp; \' +\r\n                                  \'<a class=\"red\" href=\"#\"><i class=\"icon-trash bigger-130\" ></i></a>\';\r\n                      }\r\n                  }\r\n              ]\r\n          });\r\n    });\r\n    \r\n</script>\r\n\r\n<div class=\"clearfix form-actions\">\r\n	<button class=\"btn btn-info pull-right\" type=\"button\" onclick=\"location.href=\'/IssueTaskEdit.aspx\';\">\r\n		<i class=\"icon-add bigger-110\"></i>\r\n		Add New\r\n	</button>\r\n</div>\r\nId,3,155ElementName,3,divElementId,0,Template,15,IssueTasks.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,260,.bigTitle {\r\n    font-size:16px;\r\n}\r\n\r\nimg.rowAvatar {\r\n    width: 36px;\r\n    float: left;\r\n    margin-right: 7px;\r\n    border-radius: 20%;\r\n    border: 1px solid #547ea8;\r\n}\r\ndiv.status {\r\n    display: inline-block;\r\n    color: #FFF;\r\n    padding: 2px 8px;\r\n}Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(156,'IssueTasks.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,156ElementName,3,divElementId,0,Template,15,IssueTasks.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(157,'IssueTasks.aspx','sidebar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,7,sidebarId,3,157ElementName,3,divElementId,0,Template,15,IssueTasks.aspxRegion,7,sidebarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(158,'IssueTasks.aspx','breadcrumbs',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,11,breadcrumbsId,3,158ElementName,3,divElementId,0,Template,15,IssueTasks.aspxRegion,11,breadcrumbsOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(160,'IssueTaskEdit.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,6,navbarId,3,160ElementName,3,divElementId,0,Template,18,IssueTaskEdit.aspxRegion,6,navbarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(161,'IssueTaskEdit.aspx','sidebar',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,7,sidebarId,3,161ElementName,3,divElementId,0,Template,18,IssueTaskEdit.aspxRegion,7,sidebarOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(162,'IssueTaskEdit.aspx','breadcrumbs',0,'RegionRepeater','','Cinar.CMS.Serialization\nPage,12,Default.aspxRegionToCopy,11,breadcrumbsId,3,162ElementName,3,divElementId,0,Template,18,IssueTaskEdit.aspxRegion,11,breadcrumbsOrderNo,1,0Name,14,RegionRepeaterCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(164,'IssueTaskEdit.aspx','contentDiv',0,'Form','','Cinar.CMS.Serialization\nEntityName,4,TaskInnerHtml,7824,$\r\nvar entityName = \"Task\";\r\nvar e = new Task();\r\nvar id = int.Parse(Provider.Request.eId ?? \"0\");\r\nif(id>0)\r\n    e = Provider.Database.Read(typeof(Task), id);\r\n\r\nif(Provider.Request.cmdName){\r\n    if(Provider.Request.cmdName==\"save\")\r\n    {\r\n        e.SetFieldsByPostData(Provider.Request.Form);\r\n        e.Save();\r\n        Provider.Response.Redirect(\"/IssueTaskView.aspx?eId=\"+e.Id);\r\n    }\r\n}\r\n$\r\n<script>\r\n    \\$(function(){\r\n        loadForm(\'#form\', $=Utility.ToJSON(e)$, \'$=Provider.Request.mode$\');\r\n    });\r\n</script>\r\n\r\n<div class=\"page-header\">\r\n    <h1 class=\"red\">\r\n        <i class=\"icon-check\"></i>\r\n        Task\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n        	$=e.Id>0 ? \'Edit details\' : \'Add new\'$\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<form id=\"form\" method=\"post\" action=\"$=Provider.Request.RawUrl$\" enctype=\"multipart/form-data\" class=\"form-horizontal\" role=\"form\" autocomplete=\"off\">\r\n<input type=\"hidden\" name=\"cmdName\" value=\"save\"/>\r\n<input type=\"hidden\" name=\"Id\" value=\"$=e.Id$\"/><div class=\"row\">\r\n<div class=\"col-sm-9\">\r\n        <div class=\"form-group\">\r\n            <label for=\"Name\" class=\"col-sm-4 control-label no-padding-right\"> Name </label>\r\n            <div class=\"col-sm-8\">\r\n                <input type=\"text\" name=\"Name\" id=\"Name\" placeholder=\"\" class=\"col-sm-6 form-control\"/>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class=\"form-group\">\r\n            <label for=\"Description\" class=\"col-sm-4 control-label no-padding-right\"> Description </label>\r\n    		<div class=\"col-sm-8\">\r\n                <textarea name=\"Description\" id=\"Description\" rows=\"5\" class=\"col-sm-8 form-control\"></textarea>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"ProjectId\" class=\"col-sm-4 control-label no-padding-right\"> Project </label>\r\n        	<div class=\"col-sm-8\">\r\n                <select id=\"ProjectId\" name=\"ProjectId\" class=\"col-sm-7 form-control\">\r\n                    $\r\n                    foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from Project order by Name\").Rows)\r\n                        echo(\'<option value=\"\'+dr.Id+\'\"\'+(e.ProjectId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n                    $\r\n                </select>\r\n            </div>\r\n        </div>\r\n        \r\n        <div class=\"form-group\">\r\n            <label for=\"StartDate\" class=\"col-sm-4 control-label no-padding-right\"> Start Date </label>\r\n    		<div class=\"col-sm-4 col-xs-6 input-group\">\r\n                <input class=\"date-picker form-control\" type=\"text\" name=\"StartDate\" id=\"StartDate\" data-date-format=\"dd-mm-yyyy\"/><span class=\"input-group-addon\"><i class=\"icon-calendar bigger-110\"></i></span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"DueDate\" class=\"col-sm-4 control-label no-padding-right\"> Due Date </label>\r\n    		<div class=\"col-sm-4 col-xs-6 input-group\">\r\n                <input class=\"date-picker form-control\" type=\"text\" name=\"DueDate\" id=\"DueDate\" data-date-format=\"dd-mm-yyyy\"/><span class=\"input-group-addon\"><i class=\"icon-calendar bigger-110\"></i></span>\r\n            </div>\r\n        </div>\r\n\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-xs-12 col-sm-6\">\r\n<h3 class=\"header smaller lighter blue\">Details</h3>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"Component\" class=\"col-sm-4 control-label no-padding-right\"> Component </label>\r\n    		<div class=\"col-sm-8 input-group\">\r\n                <select id=\"Component\" name=\"Component\" class=\"form-control withPlaceHolder\">\r\n                    <option value=\"0\">Component</option>\r\n                    $\r\n                    foreach(var dr in Provider.Database.GetDataTable(\"select distinct Component from Task where ProjectId=1 order by Name\").Rows)\r\n                        echo(\'<option\'+(e.Component==dr.Component ? \' selected\':\'\')+\'>\'+dr.Component+\'</option>\\r\\n\');\r\n                    $\r\n                </select>\r\n                <span class=\"input-group-addon\" onclick=\"var op = prompt(\'New component\'); if(op) \\$(\'#Component\').append(\'<option>\'+op+\'</option>\').val(op);\">add</span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"ReportedById\" class=\"col-sm-4 control-label no-padding-right\"> Reported By </label>\r\n    		<div class=\"col-sm-8 input-group\">\r\n                <select id=\"ReportedById\" name=\"ReportedById\" class=\"form-control withPlaceHolder\">\r\n                    <option value=\"0\">Reported By</option>\r\n                    $\r\n                    foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User order by Name\").Rows)\r\n                        echo(\'<option value=\"\'+dr.Id+\'\"\'+(e.ReportedById==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n                    $\r\n                </select>\r\n                <span class=\"input-group-addon\" onclick=\"\\$(\'#ReportedById\').val($=Provider.User.Id$)\">me</span>\r\n            </div>\r\n        </div>\r\n\r\n        <div class=\"form-group\">\r\n            <label for=\"AssignedToId\" class=\"col-sm-4 control-label no-padding-right\"> Assigned To </label>\r\n    		<div class=\"col-sm-8 input-group\">\r\n                <select id=\"AssignedToId\" name=\"AssignedToId\" class=\"form-control withPlaceHolder\">\r\n                    <option value=\"0\">Assigned To</option>\r\n                    $\r\n                    foreach(var dr in Provider.Database.GetDataTable(\"select Id, Name from User order by Name\").Rows)\r\n                        echo(\'<option value=\"\'+dr.Id+\'\"\'+(e.AssignedToId==dr.Id ? \' selected\':\'\')+\'>\'+dr.Name+\'</option>\\r\\n\');\r\n                    $\r\n                </select>\r\n                <span class=\"input-group-addon\" onclick=\"\\$(\'#AssignedToId\').val($=Provider.User.Id$)\">me</span>\r\n            </div>\r\n        </div>\r\n</div>\r\n<div class=\"col-xs-12 col-sm-6\">\r\n    <h3 class=\"header smaller lighter blue\">Status</h3>\r