.Avatar$\" />\r\n        							</div>\r\n        \r\n        							<div class=\"body\">\r\n        								<div class=\"time\">\r\n        									<i class=\"icon-clock-o\"></i>\r\n        									<span class=\"green\">$=Utility.ToAgoString(cc.InsertDate)$</span>\r\n        								</div>\r\n        \r\n        								<div class=\"name\">\r\n        									<a href=\"#\">$=cc.InsertUser.FullName$</a>\r\n        								</div>\r\n        								<div class=\"text\">$=cc.Description.Replace(\'\\n\',\'<br/>\\n\')$</div>\r\n        \r\n        								<div class=\"tools\">\r\n        									<a href=\"#\" class=\"btn btn-minier btn-info\">\r\n        										<i class=\"icon-only icon-share\"></i>\r\n        									</a>\r\n        								</div>\r\n        							</div>\r\n        						</div>\r\n                            $\r\n                            }\r\n                            $\r\n        				</div>\r\n\r\n        			</div>\r\n                </div>    \r\n        		</div><!-- /widget-main -->\r\n        	</div><!-- /widget-body -->\r\n        </div><!-- /widget-box -->\r\n\r\n\r\n\r\n	</div>\r\n</div>\r\nId,3,165Template,18,IssueTaskView.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlDetails,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0ParentModuleId,1,0',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(166,'IssueTaskView.aspx','navbar',0,'RegionRepeater','','Cinar.CMS.Serial