ber\">$=companiesAll$</span>\r\n			<div class=\"infobox-content\">companies</div>\r\n		</div>\r\n	</div>\r\n\r\n    <div class=\"infobox infobox-blue\" onclick=\"location.href=\'/CrmContacts.aspx\'\">\r\n		<div class=\"infobox-icon\">\r\n			<i class=\"icon-user\"></i>\r\n		</div>\r\n\r\n		<div class=\"infobox-data\">\r\n			<span class=\"infobox-data-number\">$=contactsAll$</span>\r\n			<div class=\"infobox-content\">contacts</div>\r\n		</div>\r\n	</div>\r\n\r\n    <div class=\"infobox infobox-orange\" onclick=\"location.href=\'/IssueProjects.aspx\'\">\r\n		<div class=\"infobox-icon\">\r\n			<i class=\"icon-briefcase\"></i>\r\n		</div>\r\n\r\n		<div class=\"infobox-data\">\r\n			<span class=\"infobox-data-number\">$=projectsAll$</span>\r\n			<div class=\"infobox-content\">projects</div>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"infobox infobox-red\" onclick=\"location.href=\'/IssueTasks.aspx\'\">\r\n		<div class=\"infobox-icon\">\r\n			<i class=\"icon-check\"></i>\r\n		</div>\r\n\r\n		<div class=\"infobox-data\">\r\n			<span class=\"infobox-data-number\">$=tasksAll$</span>\r\n			<div class=\"infobox-content\">tasks</div>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"space-6\"></div>\r\n</div>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<div class=\"widget-box\">\r\n    <div class=\"widget-header widget-header-flat widget-header-small\">\r\n    	<h5>\r\n			<i class=\"icon-signal\"></i>\r\n			Task Stats\r\n		</h5>\r\n\r\n		<div class=\"widget-toolbar no-border\">\r\n			<button class=\"btn btn-minier btn-primary dropdown-toggle\" data-toggle=\"dropdown\">\r\n				This Week\r\n				<i class=\"icon-angle-down icon-on-right bigger-110\"></i>\r\n			</button>\r\n\r\n			<ul class=\"dropdown-menu pull-right dropdown-125 dropdown-lighter dropdown-caret\">\r\n				<li class=\"active\">\r\n					<a href=\"#\" class=\"blue\">\r\n						<i class=\"icon-caret-right bigger-110\">&nbsp;</i>\r\n						This Week\r\n					</a>\r\n				</li>\r\n\r\n				<li>\r\n					<a href=\"#\">\r\n						<i class=\"icon-caret-right bigger-110 invisible\">&nbsp;</i>\r\n						Last Week\r\n					</a>\r\n				</li>\r\n\r\n				<li>\r\n					<a href=\"#\">\r\n						<i class=\"icon-caret-right bigger-110 invisible\">&nbsp;</i>\r\n						This Month\r\n					</a>\r\n				</li>\r\n\r\n				<li>\r\n					<a href=\"#\">\r\n						<i class=\"icon-caret-right bigger-110 invisible\">&nbsp;</i>\r\n						Last Month\r\n					</a>\r\n				</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n\r\n	<div class=\"widget-body\">\r\n		<div class=\"widget-main\">\r\n			<div id=\"piechart-placeholder\"></div>\r\n\r\n			<div class=\"hr hr8 hr-double\"></div>\r\n\r\n			<div class=\"clearfix\">\r\n				<div class=\"grid4\">\r\n					<span class=\"grey\">\r\n						<i class=\"icon-check blue\"></i>\r\n						&nbsp; New\r\n					</span>\r\n                    <br/>\r\n					<h4 class=\"bigger pull-right\">$=Provider.Database.GetInt(\"select count(*) from Task where Status=\'New\'\")$</h4>\r\n				</div>\r\n\r\n				<div class=\"grid4\">\r\n    				<span class=\"grey\">\r\n						<i class=\"icon-check orange\"></i>\r\n						&nbsp; Accepted\r\n					</span>\r\n                    <br/>\r\n					<h4 class=\"bigger pull-right\">$=Provider.Database.GetInt(\"select count(*) from Task where Status=\'Accepted\'\")$</h4>\r\n				</div>\r\n\r\n				<div class=\"grid4\">\r\n    				<span class=\"grey\">\r\n						<i class=\"icon-check green\"></i>\r\n						&nbsp; Completed\r\n					</span>\r\n                    <br/>\r\n					<h4 class=\"bigger pull-right\">$=Provider.Database.GetInt(\"select count(*) from Task where Status=\'Completed\'\")$</h4>\r\n				</div>\r\n                \r\n                $\r\n                var taskComp = Provider.Database.GetInt(\"select round(sum(IF(Status=\'Completed\' OR Status=\'Rejected\',1,0))/count(*)*100) from Task where Visible=1\");\r\n                $\r\n                <div class=\"grid4 infobox infobox-green infobox-small infobox-dark\">\r\n            		<div class=\"infobox-progress\">\r\n            			<div class=\"easy-pie-chart percentage easyPieChart\" data-percent=\"$=taskComp$\" data-size=\"39\" style=\"width: 39px; height: 39px; line-height: 39px;\">\r\n            				<span class=\"percent\">$=taskComp$</span>%\r\n            			<canvas width=\"39\" height=\"39\"></canvas></div>\r\n            		</div>\r\n            	</div>\r\n                \r\n			</div>\r\n		</div><!-- /widget-main -->\r\n	</div><!-- /widget-body -->\r\n</div>\r\n\r\n$\r\nvar dt = Provider.Database.GetDataTable(\"select Status as label, round(count(*)) as data, \r\n            case when Status=\'New\' then \'#2091CF\' when Status=\'Accepted\' then \'#FFB752\' when Status=\'Rejected\' then \'#DA5430\' else \'#68BC31\' end as color \r\n        from Task group by 1\");\r\n$\r\n\r\n<script>\r\n\\$(drawPieChartOfTasks);\r\nfunction drawPieChartOfTasks(){\r\n  var placeholder = \\$(\'#piechart-placeholder\').css({\'width\':\'90%\' , \'min-height\':\'150px\'});\r\n  var data = $=Utility.ToJSON(dt.Rows)$;\r\n  function drawPieChart(placeholder, data, position) {\r\n       \\$.plot(placeholder, data, {\r\n		series: {\r\n			pie: {\r\n				show: true,\r\n				tilt:0.8,\r\n				highlight: {\r\n					opacity: 0.25\r\n				},\r\n				stroke: {\r\n					color: \'#fff\',\r\n					width: 2\r\n				},\r\n				startAngle: 2\r\n			}\r\n		},\r\n		legend: {\r\n			show: true,\r\n			position: position || \"ne\", \r\n			labelBoxBorderColor: null,\r\n			margin:[-30,15]\r\n		}\r\n		,\r\n		grid: {\r\n			hoverable: true,\r\n			clickable: true\r\n		}\r\n	 })\r\n }\r\n    drawPieChart(placeholder, data);\r\n    \r\n    /**\r\n    we saved the drawing function and the data to redraw with different position later when switching to RTL mode dynamically\r\n    so that\'s not needed actually.\r\n    */\r\n    placeholder.data(\'chart\', data);\r\n    placeholder.data(\'draw\', drawPieChart);\r\n    \r\n\r\n\r\n  var \\$tooltip = \\$(\"<div class=\'tooltip top in\'><div class=\'tooltip-inner\'></div></div>\").hide().appendTo(\'body\');\r\n  var previousPoint = null;\r\n\r\n  placeholder.on(\'plothover\', function (event, pos, item) {\r\n	if(item) {\r\n		if (previousPoint != item.seriesIndex) {\r\n			previousPoint = item.seriesIndex;\r\n			var tip = item.series[\'label\'] + \" : \" + Math.round(item.series[\'percent\']) + \'%\';\r\n			\\$tooltip.show().children(0).text(tip);\r\n		}\r\n		\\$tooltip.css({top:pos.pageY + 10, left:pos.pageX + 10});\r\n	} else {\r\n		\\$tooltip.hide();\r\n		previousPoint = null;\r\n	}\r\n	\r\n });    \r\n}    \r\n</script>Id,3,169Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,46,.infobox {\r\n    cursor: pointer !important;\r\n}TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,8,col-sm-6Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0ElementId,0,ElementName,3,div',NULL,NULL,0,NULL,NULL,NULL,'Default',NULL,'','div'),(171,'Timeline.aspx','contentDiv',0,'StaticHtml','','Cinar.CMS.Serialization\nInnerHtml,2020,<div class=\"page-header\">\r\n    <h1>\r\n		Timeline\r\n		<small>\r\n			<i class=\"icon-double-angle-right\"></i>\r\n			What is happening?\r\n		</small>\r\n	</h1>\r\n</div>\r\n\r\n<div class=\"row\">\r\n	<div class=\"col-xs-12 col-sm-10 col-sm-offset-1\">\r\n    \r\n		<div class=\"timeline-container\">\r\n\r\n		</div>\r\n        \r\n    </div>\r\n</div>\r\n\r\n    			<div id=\"timelineItemTemplate\" class=\"timeline-item clearfix\" style=\"display:none\">\r\n					<div class=\"timeline-info\">\r\n						<img src=\"{{Avatar}}\" />\r\n					</div>\r\n\r\n					<div class=\"widget-box transparent\">\r\n						<div class=\"widget-header widget-header-small\">\r\n							<h5 class=\"smaller\">\r\n								<a href=\"#\" class=\"blue\">{{Name}}</a>\r\n								<span class=\"grey\">{{Prompt}}</span>\r\n							</h5>\r\n							<span class=\"widget-toolbar\">\r\n								<a href=\"#\" data-action=\"collapse\">\r\n									<i class=\"icon-chevron-up\"></i>\r\n								</a>\r\n                            </span>\r\n\r\n    						<span class=\"widget-toolbar no-border\">\r\n								<i class=\"icon-time bigger-110\"></i>\r\n								{{Time}}\r\n							</span>\r\n						</div>\r\n\r\n						<div class=\"widget-body\">\r\n							<div class=\"widget-main\">\r\n        						<span class=\"black\">{{Icon}} <a href=\"{{ViewLink}}\">{{Title}}</a></span><br/>\r\n								{{Details}}\r\n							</div>\r\n						</div>\r\n					</div>\r\n				</div>\r\n\r\n\r\n<script>\r\n    var canLoadPosts = true;\r\n    jQuery(function(){\r\n        readPosts(\'$=DateTime.Now.ToString(\"dd-MM-yyyy HH:mm\")$\', appendPostsToStreamBottom);\r\n        if(typeof(noRefresh)!=\'undefined\' && noRefresh)\r\n            return; //***\r\n\r\n        jQuery(window).scroll(function() {  \r\n            if(jQuery(document).height() - jQuery(window).scrollTop() - jQuery(window).height() < 300 && canLoadPosts) \r\n            {\r\n                readPosts(jQuery(\'.timeline-container .timeline-item:last\').attr(\'date\'), appendPostsToStreamBottom, \r\n                    function(){\r\n                        canLoadPosts = true;\r\n                    });\r\n                canLoadPosts = false;\r\n            }\r\n        });\r\n    });\r\n</script>Id,3,171ElementName,3,divElementId,0,Template,13,Timeline.aspxRegion,10,contentDivOrderNo,1,0Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,609,Cinar.CMS.Serialization\nInnerHtml,57,<h3 class=\"header smaller lighter blue\">Kullanıcılar</h3>Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,9,col-xs-12Visible,4,TrueRoleToRead,0,UseCache,7,DefaultCacheLifeTime,1,0Details,265,Cinar.CMS.Serialization\nInnerHtml,0,Id,2,64ElementName,3,divElementId,0,Template,12,Default.aspxRegion,10,contentDivOrderNo,1,9Name,10,StaticHtmlCSS,0,TopHtml,0,BottomHtml,0,ParentModuleId,1,0CSSClass,0,Visible,4,TrueRoleToRead,0,UseCac