ider.Request.EventId);\r\n    \r\n    echo(res+\" records inserted\");\r\n}\r\n$\r\n',19,'2014-06-05 22:59:03',1,'2014-06-05 23:47:03',1,1,0),('CrmCompanyView.aspx','use:Default.aspx',20,'2014-06-10 22:09:28',1,'2014-06-10 22:09:28',1,1,0),('IssueProjects.aspx','use:Default.aspx',21,'2014-06-18 03:30:13',1,'2014-06-18 16:57:59',1,1,0),('IssueProjectEdit.aspx','use:Default.aspx',22,'2014-06-18 03:46:39',1,'2014-06-18 03:46:39',1,1,0),('IssueProjectView.aspx','use:Default.aspx',23,'2014-06-18 14:29:05',1,'2014-06-18 14:29:05',1,1,0),('IssueTasks.aspx','use:Default.aspx',24,'2014-06-18 17:25:13',1,'2014-06-18 17:25:13',1,1,0),('IssueTaskEdit.aspx','use:Default.aspx',25,'2014-06-18 17:38:02',1,'2014-06-18 17:38:02',1,1,0),('IssueTaskView.aspx','use:Default.aspx',26,'2014-06-20 01:32:34',1,'2014-06-20 01:32:34',1,1,0),('Timeline.aspx','use:Default.aspx',27,'2014-06-24 18:36:25',1,'2014-06-24 18:36:25',1,1,0),('CrmContactsToExcel.aspx','$\r\nusing System.Text;\r\n\r\nvar dt = Provider.Database.GetDataTable(\"\r\nSELECT\r\n    tit.Name AS Title,\r\n	contact.Name,\r\n	company.Name AS Company,\r\n	contact.Description,\r\n	contact.Tags,\r\n	contact.Gender,\r\n	contact.BirthDate,\r\n	contact.Phone,\r\n	contact.InterPhone,\r\n	contact.Phone2,\r\n	contact.Fax,\r\n	contact.AddressLine1,\r\n	contact.AddressLine2,\r\n	contact.City,\r\n	cnt.Name AS Country,\r\n	contact.ZipCode,\r\n	contact.Email,\r\n	contact.Email2,\r\n	contact.Email3,\r\n	contact.Web,\r\n	contact.ExtraField1 as HazarWorld,\r\n	contact.ExtraField2 as CaspianReport,\r\n	user.Name AS User,\r\n	contact.NewsletterMembership,\r\n	contact.PhoneMobile,\r\n	contact.ReferenceBy,\r\n	contact.Town,\r\n	inte1.Name as Interest1,\r\n	inte2.Name as Interest2,\r\n	inte3.Name as Interest3,\r\n	knd1.Name AS Statu1,\r\n	knd2.Name AS Statu2,\r\n	knd3.Name AS Statu3,\r\n	lng1.Name AS Lang1,\r\n	lng2.Name AS Lang2,\r\n	lng3.Name AS Lang3\r\nFROM\r\n	contact\r\n	LEFT JOIN definition tit ON contact.TitleId = tit.Id\r\n	LEFT JOIN company ON contact.CompanyId = company.Id\r\n	LEFT JOIN definition lng1 ON contact.Language1Id = lng1.Id\r\n	LEFT JOIN definition lng2 ON contact.Language2Id = lng2.Id\r\n	LEFT JOIN definition lng3 ON contact.Language3Id = lng3.Id\r\n	LEFT JOIN definition knd1 ON contact.Kind1Id = knd1.Id\r\n	LEFT JOIN definition knd2 ON contact.Kind2Id = knd2.Id\r\n	LEFT JOIN definition knd3 ON contact.Kind3Id = knd3.Id\r\n	LEFT JOIN definition inte1 ON contact.InterestId1 = inte1.Id\r\n	LEFT JOIN definition inte2 ON contact.InterestId2 = inte2.Id\r\n	LEFT JOIN definition inte3 ON contact.InterestId3 = inte3.Id\r\n	LEFT JOIN definition cnt ON contact.CountryId = cnt.Id\r\n	LEFT JOIN user ON contact.UserId = user.Id\r\n\");\r\n\r\nvar res = Provider.Response;\r\n\r\nres.Clear();\r\nres.ClearContent();\r\nres.ClearHeaders();\r\nres.ContentType = \"application/ms-excel\";\r\n//res.ContentEncoding = Encoding.UTF8;\r\nres.AddHeader(\"Content-Disposition\", \"attachment;filename=Hazar Contacts \"+DateTime.Now.ToShortDateString()+\".xls\");\r\n\r\n//res.BinaryWrite(Encoding.UTF8.GetPreamble());\r\n\r\nres.Write(Utility.ToHtmlTable(dt));\r\n\r\nres.Flush();\r\nres.Close();\r\n$',28,'2014-06-27 00:34:47',1,'2014-06-27 01:24:12',1,1,0),('CrmCompanyToExcel.aspx','$\r\nusing System.Text;\r\n\r\nvar dt = Provider.Database.GetDataTable(\"\r\nSELECT\r\n    company.Name,\r\n	sect.Name AS Sector,\r\n	company.Tags,\r\n	user.Name AS User,\r\n	company.Phone,\r\n	company.Fax,\r\n	company.AddressLine1,\r\n	company.AddressLine2,\r\n	company.City,\r\n	cnt.Name AS Country,\r\n	company.ZipCode,\r\n	company.Email,\r\n	company.Web,\r\n	company.ExtraField1 as Sponsorship,\r\n	company.Description\r\nFROM\r\n	company\r\n	LEFT JOIN definition sect ON company.SectorId = sect.Id\r\n	LEFT JOIN user ON company.UserId = user.Id\r\n	LEFT JOIN definition cnt ON company.CountryId = cnt.Id\r\n\");\r\n\r\nvar res = Provider.Response;\r\n\r\nres.Clear();\r\nres.ClearContent();\r\nres.ClearHeaders();\r\nres.ContentType = \"application/ms-excel\";\r\n//res.ContentEncoding = Encoding.UTF8;\r\nres.AddHeader(\"Content-Disposition\", \"attachment;filename=Hazar Companies \"+DateTime.Now.ToShortDateString()+\".xls\");\r\n\r\n//res.BinaryWrite(Encoding.UTF8.GetPreamble());\r\n\r\nres.Write(Utility.ToHtmlTable(dt));\r\n\r\nres.Flush();\r\nres.Close();\r\n$',29,'2014-06-27 01:29:57',1,'2014-06-27 01:29:57',1,1,0);
